( '3', 'Quality Products in Affordable Prices', 'quality-products-in-affordable-prices', '100003', '<h3><strong>Quality Products in Affordable Prices</strong></h3><p><img src="http://localhost:3000/static/media/blog-details-post-banner.f3aa194b.png" alt=""></p><p>We are focusing on our customers more than anything else. Our business is fully customer-oriented. These are the reason why we are trying to give our customers world-class service by providing them several options for payment, easy ways to order, return and get a refund. Our mission is to serve our customers with the best quality products at the most affordable prices. All of the products we offer are imported from China and are meant to make your daily life easier.<br><br>If you purchase any product from us, you will get your products within 2 working days if your location is inside Dhaka. If you are a resident of outer Dhaka, you will receive your products within 2-7 days depending on the type of delivery you choose.</p><p><img src="http://localhost:3000/static/media/blog-web-1.6636a539.png" alt=""></p><p>We are focusing on our customers more than anything else. Our business is fully customer-oriented. These are the reason why we are trying to give our customers world-class service by providing them several options for payment, easy ways to order, return and get a refund. Our mission is to serve our customers with the best quality products at the most affordable prices. All of the products we offer are imported from China and are meant to make your daily life easier.</p>', 'quality-products-in-affordable-prices-100003.webp', '1', '2', '4', '2022-01-22 13:13:57', '2022-01-22 13:13:57' ),
( '4', 'The Quick & Easy Guide To Freezing Rows in Excel', 'the-quick-and-easy-guide-to-freezing-rows-in-excel', '100004', '<p>Without freezing rows or columns in your <a href="https://blog.hubspot.com/marketing/microsoft-excel?_ga=2.209684625.228818385.1641500271-1485849938.1641500271"><strong>Excel</strong></a>&nbsp;spreadsheet, everything moves when you scroll through the page, as shown in the gif below.</p><p><img src="https://blog.hubspot.com/hs-fs/hubfs/gif%201-Jan-06-2022-08-21-45-67-PM.gif?width=558&amp;name=gif%201-Jan-06-2022-08-21-45-67-PM.gif" alt="freeze rows in excel" srcset="https://blog.hubspot.com/hs-fs/hubfs/gif%201-Jan-06-2022-08-21-45-67-PM.gif?width=279&amp;name=gif%201-Jan-06-2022-08-21-45-67-PM.gif 279w, https://blog.hubspot.com/hs-fs/hubfs/gif%201-Jan-06-2022-08-21-45-67-PM.gif?width=558&amp;name=gif%201-Jan-06-2022-08-21-45-67-PM.gif 558w, https://blog.hubspot.com/hs-fs/hubfs/gif%201-Jan-06-2022-08-21-45-67-PM.gif?width=837&amp;name=gif%201-Jan-06-2022-08-21-45-67-PM.gif 837w, https://blog.hubspot.com/hs-fs/hubfs/gif%201-Jan-06-2022-08-21-45-67-PM.gif?width=1116&amp;name=gif%201-Jan-06-2022-08-21-45-67-PM.gif 1116w, https://blog.hubspot.com/hs-fs/hubfs/gif%201-Jan-06-2022-08-21-45-67-PM.gif?width=1395&amp;name=gif%201-Jan-06-2022-08-21-45-67-PM.gif 1395w, https://blog.hubspot.com/hs-fs/hubfs/gif%201-Jan-06-2022-08-21-45-67-PM.gif?width=1674&amp;name=gif%201-Jan-06-2022-08-21-45-67-PM.gif 1674w" sizes="100vw" width="558">This can be frustrating if you can’t always see key data markers that explain what data is what, like column headers or row titles.</p><p>As with many things on Excel, there are tricks that help you make your spreadsheets easier to read, like the freeze function. In this post, learn how to freeze rows and columns in Excel to ensure that, when you scroll around, you’ll always be able to view the key data points that matter most.</p><p>&nbsp;</p><h3><a href="https://blog.hubspot.com/cs/c/?cta_guid=d27396d3-b487-4277-b356-b620c0d9df47&amp;signature=AAH58kE_X5NKiIFOWefv7jXksn4ilOzCPw&amp;pageId=63308307005&amp;placement_guid=9ff7a4fe-5293-496c-acca-566bc6e73f42&amp;click=aea7cb00-d987-45b1-bf6f-d59d83886910&amp;hsutk=4aa295357806de3c439fa194a63f403d&amp;canon=https%3A%2F%2Fblog.hubspot.com%2Fmarketing%2Ffreeze-row-excel&amp;portal_id=53&amp;redirect_url=APefjpFbFgt-c49bRq-8_i_Tx0Kx4q2oV2Msth1YsgpBEZXTVEW_lc6glvFVnCAwlkXJMlZui2oT1zAUfLsXBfFy7RJpj2wH_-qlSZljkjWTJSSR9FSlhE-L-WmUj0EQWKLIBkphiBQaHBtZLZuoBCk2cn2n5jWkiPuQdrNiTApXgGPMA5k95LFItDFHUmuntwC02FWCgR-Z&amp;__hstc=20629287.4aa295357806de3c439fa194a63f403d.1642845065032.1642845065032.1642845065032.1&amp;__hssc=20629287.1.1642845065033&amp;__hsfp=250188394&amp;contentType=blog-post"><strong>Download 10 Excel Templates for Marketers [Free Kit]</strong></a></h3><p>&nbsp;</p><h2><strong>How to Freeze a Top Row in Excel</strong></h2><p>The image below is the sample data set I’ll use to run through the explanations in this piece.</p><p><img src="https://blog.hubspot.com/hs-fs/hubfs/sample%20data%20set.png?width=650&amp;name=sample%20data%20set.png" alt="sample data set" srcset="https://blog.hubspot.com/hs-fs/hubfs/sample%20data%20set.png?width=325&amp;name=sample%20data%20set.png 325w, https://blog.hubspot.com/hs-fs/hubfs/sample%20data%20set.png?width=650&amp;name=sample%20data%20set.png 650w, https://blog.hubspot.com/hs-fs/hubfs/sample%20data%20set.png?width=975&amp;name=sample%20data%20set.png 975w, https://blog.hubspot.com/hs-fs/hubfs/sample%20data%20set.png?width=1300&amp;name=sample%20data%20set.png 1300w, https://blog.hubspot.com/hs-fs/hubfs/sample%20data%20set.png?width=1625&amp;name=sample%20data%20set.png 1625w, https://blog.hubspot.com/hs-fs/hubfs/sample%20data%20set.png?width=1950&amp;name=sample%20data%20set.png 1950w" sizes="100vw" width="650"></p><p>1. To freeze the top row in an Excel spreadsheet, navigate to the header toolbar and select <i>View</i>, as shown in the image below.<br><img src="https://blog.hubspot.com/hs-fs/hubfs/select%20view%20image%202.png?width=567&amp;name=select%20view%20image%202.png" alt="freeze top row in excel steps: select view" srcset="https://blog.hubspot.com/hs-fs/hubfs/select%20view%20image%202.png?width=284&amp;name=select%20view%20image%202.png 284w, https://blog.hubspot.com/hs-fs/hubfs/select%20view%20image%202.png?width=567&amp;name=select%20view%20image%202.png 567w, https://blog.hubspot.com/hs-fs/hubfs/select%20view%20image%202.png?width=851&amp;name=select%20view%20image%202.png 851w, https://blog.hubspot.com/hs-fs/hubfs/select%20view%20image%202.png?width=1134&amp;name=select%20view%20image%202.png 1134w, https://blog.hubspot.com/hs-fs/hubfs/select%20view%20image%202.png?width=1418&amp;name=select%20view%20image%202.png 1418w, https://blog.hubspot.com/hs-fs/hubfs/select%20view%20image%202.png?width=1701&amp;name=select%20view%20image%202.png 1701w" sizes="100vw" width="567"><br>2. When the <i>View</i>&nbsp;menu options appear, Click <i>Freeze Top Row</i>, outlined in red in the image below. &nbsp;<br>&nbsp;</p><p><img src="https://blog.hubspot.com/hs-fs/hubfs/freeze%20top%20row%20image%203.png?width=576&amp;name=freeze%20top%20row%20image%203.png" alt="freeze top row in excel steps: select freeze top row" srcset="https://blog.hubspot.com/hs-fs/hubfs/freeze%20top%20row%20image%203.png?width=288&amp;name=freeze%20top%20row%20image%203.png 288w, https://blog.hubspot.com/hs-fs/hubfs/freeze%20top%20row%20image%203.png?width=576&amp;name=freeze%20top%20row%20image%203.png 576w, https://blog.hubspot.com/hs-fs/hubfs/freeze%20top%20row%20image%203.png?width=864&amp;name=freeze%20top%20row%20image%203.png 864w, https://blog.hubspot.com/hs-fs/hubfs/freeze%20top%20row%20image%203.png?width=1152&amp;name=freeze%20top%20row%20image%203.png 1152w, https://blog.hubspot.com/hs-fs/hubfs/freeze%20top%20row%20image%203.png?width=1440&amp;name=freeze%20top%20row%20image%203.png 1440w, https://blog.hubspot.com/hs-fs/hubfs/freeze%20top%20row%20image%203.png?width=1728&amp;name=freeze%20top%20row%20image%203.png 1728w" sizes="100vw" width="576"></p><p>Once selected, everything in the top row of your Excel spreadsheet (row 1) will be frozen, and you can scroll up and down in your spreadsheet, but the top rows won’t move, as shown in the gif below.</p><p><img src="https://blog.hubspot.com/hs-fs/hubfs/2%20gif.gif?width=572&amp;name=2%20gif.gif" alt="freeze top row in excel steps: frozen top row in excel" srcset="https://blog.hubspot.com/hs-fs/hubfs/2%20gif.gif?width=286&amp;name=2%20gif.gif 286w, https://blog.hubspot.com/hs-fs/hubfs/2%20gif.gif?width=572&amp;name=2%20gif.gif 572w, https://blog.hubspot.com/hs-fs/hubfs/2%20gif.gif?width=858&amp;name=2%20gif.gif 858w, https://blog.hubspot.com/hs-fs/hubfs/2%20gif.gif?width=1144&amp;name=2%20gif.gif 1144w, https://blog.hubspot.com/hs-fs/hubfs/2%20gif.gif?width=1430&amp;name=2%20gif.gif 1430w, https://blog.hubspot.com/hs-fs/hubfs/2%20gif.gif?width=1716&amp;name=2%20gif.gif 1716w" sizes="100vw" width="572"></p><h2><strong>How to Freeze a Specific Row in Excel</strong></h2><p>While excel has native functions for freezing the top row of a data set and the first column of a data set, there are additional steps to take to freeze other elements of your data set that aren’t those two things.</p><p>1. To freeze a specific row in Excel, select the row number immediately underneath the one you want frozen. For this example, I’m selecting row number three to freeze row number two.</p><p><img src="https://blog.hubspot.com/hs-fs/hubfs/row%20below%20image%204.png?width=570&amp;name=row%20below%20image%204.png" alt="freeze specific row in excel steps: select row below row you want to freeze" srcset="https://blog.hubspot.com/hs-fs/hubfs/row%20below%20image%204.png?width=285&amp;name=row%20below%20image%204.png 285w, https://blog.hubspot.com/hs-fs/hubfs/row%20below%20image%204.png?width=570&amp;name=row%20below%20image%204.png 570w, https://blog.hubspot.com/hs-fs/hubfs/row%20below%20image%204.png?width=855&amp;name=row%20below%20image%204.png 855w, https://blog.hubspot.com/hs-fs/hubfs/row%20below%20image%204.png?width=1140&amp;name=row%20below%20image%204.png 1140w, https://blog.hubspot.com/hs-fs/hubfs/row%20below%20image%204.png?width=1425&amp;name=row%20below%20image%204.png 1425w, https://blog.hubspot.com/hs-fs/hubfs/row%20below%20image%204.png?width=1710&amp;name=row%20below%20image%204.png 1710w" sizes="100vw" width="570"></p><p>2. After selecting your row, navigate to <i>View</i>&nbsp;in the header toolbar and select Freeze Panes.</p><p><img src="https://blog.hubspot.com/hs-fs/hubfs/freeze%20panes%20image%205.png?width=581&amp;name=freeze%20panes%20image%205.png" alt="freeze specific row in excel steps: select freeze panes" srcset="https://blog.hubspot.com/hs-fs/hubfs/freeze%20panes%20image%205.png?width=291&amp;name=freeze%20panes%20image%205.png 291w, https://blog.hubspot.com/hs-fs/hubfs/freeze%20panes%20image%205.png?width=581&amp;name=freeze%20panes%20image%205.png 581w, https://blog.hubspot.com/hs-fs/hubfs/freeze%20panes%20image%205.png?width=872&amp;name=freeze%20panes%20image%205.png 872w, https://blog.hubspot.com/hs-fs/hubfs/freeze%20panes%20image%205.png?width=1162&amp;name=freeze%20panes%20image%205.png 1162w, https://blog.hubspot.com/hs-fs/hubfs/freeze%20panes%20image%205.png?width=1453&amp;name=freeze%20panes%20image%205.png 1453w, https://blog.hubspot.com/hs-fs/hubfs/freeze%20panes%20image%205.png?width=1743&amp;name=freeze%20panes%20image%205.png 1743w" sizes="100vw" width="581">Once selected, you’ll be able to scroll up and down through your spreadsheet and always see row two.</p><p><img src="https://blog.hubspot.com/hs-fs/hubfs/gif%203-Jan-06-2022-08-26-15-85-PM.gif?width=574&amp;name=gif%203-Jan-06-2022-08-26-15-85-PM.gif" alt="freeze specific row in excel" srcset="https://blog.hubspot.com/hs-fs/hubfs/gif%203-Jan-06-2022-08-26-15-85-PM.gif?width=287&amp;name=gif%203-Jan-06-2022-08-26-15-85-PM.gif 287w, https://blog.hubspot.com/hs-fs/hubfs/gif%203-Jan-06-2022-08-26-15-85-PM.gif?width=574&amp;name=gif%203-Jan-06-2022-08-26-15-85-PM.gif 574w, https://blog.hubspot.com/hs-fs/hubfs/gif%203-Jan-06-2022-08-26-15-85-PM.gif?width=861&amp;name=gif%203-Jan-06-2022-08-26-15-85-PM.gif 861w, https://blog.hubspot.com/hs-fs/hubfs/gif%203-Jan-06-2022-08-26-15-85-PM.gif?width=1148&amp;name=gif%203-Jan-06-2022-08-26-15-85-PM.gif 1148w, https://blog.hubspot.com/hs-fs/hubfs/gif%203-Jan-06-2022-08-26-15-85-PM.gif?width=1435&amp;name=gif%203-Jan-06-2022-08-26-15-85-PM.gif 1435w, https://blog.hubspot.com/hs-fs/hubfs/gif%203-Jan-06-2022-08-26-15-85-PM.gif?width=1722&amp;name=gif%203-Jan-06-2022-08-26-15-85-PM.gif 1722w" sizes="100vw" width="574">Note that using the Freeze Panes function to freeze rows also freezes every row above the row you initially selected. For example, in the gif below, I selected row five which also freeze rows four, three, two, and one.</p><p><img src="https://blog.hubspot.com/hs-fs/hubfs/gif%204-Jan-06-2022-08-27-21-59-PM.gif?width=572&amp;name=gif%204-Jan-06-2022-08-27-21-59-PM.gif" alt="gif 4-Jan-06-2022-08-27-21-59-PM" srcset="https://blog.hubspot.com/hs-fs/hubfs/gif%204-Jan-06-2022-08-27-21-59-PM.gif?width=286&amp;name=gif%204-Jan-06-2022-08-27-21-59-PM.gif 286w, https://blog.hubspot.com/hs-fs/hubfs/gif%204-Jan-06-2022-08-27-21-59-PM.gif?width=572&amp;name=gif%204-Jan-06-2022-08-27-21-59-PM.gif 572w, https://blog.hubspot.com/hs-fs/hubfs/gif%204-Jan-06-2022-08-27-21-59-PM.gif?width=858&amp;name=gif%204-Jan-06-2022-08-27-21-59-PM.gif 858w, https://blog.hubspot.com/hs-fs/hubfs/gif%204-Jan-06-2022-08-27-21-59-PM.gif?width=1144&amp;name=gif%204-Jan-06-2022-08-27-21-59-PM.gif 1144w, https://blog.hubspot.com/hs-fs/hubfs/gif%204-Jan-06-2022-08-27-21-59-PM.gif?width=1430&amp;name=gif%204-Jan-06-2022-08-27-21-59-PM.gif 1430w, https://blog.hubspot.com/hs-fs/hubfs/gif%204-Jan-06-2022-08-27-21-59-PM.gif?width=1716&amp;name=gif%204-Jan-06-2022-08-27-21-59-PM.gif 1716w" sizes="100vw" width="572"></p><h2><strong>How to Freeze the First Column in Excel</strong></h2><p>1. To freeze the first column of your Excel spreadsheet (column A), navigate to the Excel header toolbar, select <i>View</i>, and click <i>Freeze First Column</i>.</p><p>Once selected, you’ll be able to scroll side to side within your sheet, and the first column of your data set will always be visible, as shown in the image below.</p><p><img src="https://blog.hubspot.com/hs-fs/hubfs/gif%206.gif?width=788&amp;name=gif%206.gif" alt="freeze first column in excel" srcset="https://blog.hubspot.com/hs-fs/hubfs/gif%206.gif?width=394&amp;name=gif%206.gif 394w, https://blog.hubspot.com/hs-fs/hubfs/gif%206.gif?width=788&amp;name=gif%206.gif 788w, https://blog.hubspot.com/hs-fs/hubfs/gif%206.gif?width=1182&amp;name=gif%206.gif 1182w, https://blog.hubspot.com/hs-fs/hubfs/gif%206.gif?width=1576&amp;name=gif%206.gif 1576w, https://blog.hubspot.com/hs-fs/hubfs/gif%206.gif?width=1970&amp;name=gif%206.gif 1970w, https://blog.hubspot.com/hs-fs/hubfs/gif%206.gif?width=2364&amp;name=gif%206.gif 2364w" sizes="100vw" width="788"></p><h2><strong>How to Freeze a Specific Column in Excel</strong></h2><p>1. If you want to freeze a specific column in excel, select the column letter that is immediately next to the column you want frozen and click <i>Freeze Panes</i>&nbsp;in the <i>View</i>&nbsp;header menu.</p><p>Once selected, you can scroll side to side through your entire data set and continue to see those columns. In the gif below, I’ve frozen columns A and B.</p><p><img src="https://blog.hubspot.com/hs-fs/hubfs/gif%205.gif?width=600&amp;name=gif%205.gif" alt="freeze specific column in excel" srcset="https://blog.hubspot.com/hs-fs/hubfs/gif%205.gif?width=300&amp;name=gif%205.gif 300w, https://blog.hubspot.com/hs-fs/hubfs/gif%205.gif?width=600&amp;name=gif%205.gif 600w, https://blog.hubspot.com/hs-fs/hubfs/gif%205.gif?width=900&amp;name=gif%205.gif 900w, https://blog.hubspot.com/hs-fs/hubfs/gif%205.gif?width=1200&amp;name=gif%205.gif 1200w, https://blog.hubspot.com/hs-fs/hubfs/gif%205.gif?width=1500&amp;name=gif%205.gif 1500w, https://blog.hubspot.com/hs-fs/hubfs/gif%205.gif?width=1800&amp;name=gif%205.gif 1800w" sizes="100vw" width="600">Using the freeze function in Excel makes your spreadsheets easier to understand, as you can ensure that critical rows and columns are always visible as you scroll through your data.</p><p><img src="https://fs.hubspotusercontent00.net/hubfs/53/hub_generated/resized/ef8ec6f0-a50f-4f11-9601-341edfb26ac9.png" alt="excel marketing templates"></p>', 'the-quick-and-easy-guide-to-freezing-rows-in-excel-100004.webp', '1', NULL, '4', '2022-01-22 15:53:03', '2022-01-22 15:53:03' ),
( '5', 'When, Why, & How to Pivot a Startup Business', 'when-why-and-how-to-pivot-a-startup-business', '100005', '<p>Instagram wasn\'t always Instagram as we know it — meaning it didn\'t start as an application dedicated to photo-sharing. Instead, the former location based check-in platform underwent a startup pivot, or business pivot as it’s sometimes called.</p><p>Several factors contribute to whether or not a pivot may be the right move for your startup. We’ll explore why and how to pivot your business so you can make the decision that’s right for you.</p><p>&nbsp;</p><h3><a href="https://blog.hubspot.com/cs/c/?cta_guid=c0074db6-3b85-45df-a267-2b601d3ceb91&amp;signature=AAH58kErWi7b1EfX1hcQX6LsaxfXI3gRxA&amp;pageId=27054667128&amp;placement_guid=6ba52ce7-bb69-4b63-965b-4ea21ba905da&amp;click=2256e9c4-2fde-4eec-99b1-29774c25edfa&amp;hsutk=ec2969e6350cef2175af765b2d433b77&amp;canon=https%3A%2F%2Fblog.hubspot.com%2Fsales%2Fpivot-startup&amp;portal_id=53&amp;redirect_url=APefjpGxIxNbkMTsUcUT8ptj89J5b5piNRGReYcACeI4gel7jTLmi3qd-mvMEHJh1e4QwyZlvIMqcXB6jvu60twnfwv3oa0kvdDyJ3LY9ZhLWpsib45CZCG8bBqLOl-rXXW-2mEDkLbtNBr1zhbhNaDrVs4Y7pwd84WZz_UP7JvhVRv9BCq3HMM&amp;__hstc=20629287.ec2969e6350cef2175af765b2d433b77.1642845329842.1642845329842.1642845329842.1&amp;__hssc=20629287.1.1642845329842&amp;__hsfp=250188394&amp;contentType=blog-post"><strong>→ Download Now: Market Research Templates [Free Kit]</strong></a></h3><p>&nbsp;</p><p>&nbsp;</p><h2>The Startup Pivot</h2><p>A startup pivot, or business pivot, occurs occurs when a company shifts its business strategy to accommodate changes in its industry, customer preferences, or any other factor that impacts its bottom line. It\'s essentially the process of a startup translating direct or indirect feedback into a change in its business model.</p><p>&nbsp;</p><p>Drastic pivots like Instagram\'s are the ones you tend to hear about, but not every pivot is a fundamental change to an entire company. Startups don\'t always have the need or resources to pull something that radical off. In many cases, a company will only have a single problem that needs to be addressed.</p><p>A pivot could be anything from changing how a product is manufactured to shifting marketing efforts to appeal to new buyer personas. The term is relatively fluid, but it always entails a change in <a href="https://blog.hubspot.com/sales/organic-growth"><strong>startup\'s business strategy</strong></a>, generally dictated by factors beyond its control.</p><h3>When to Pivot a Startup</h3><p>It can be tricky to know when to pivot your business model. We’ve compiled a few reasons to help you evaluate whether or not one is right for your business.</p><h4>1. One piece <i>really</i> stands out.</h4><p>Sometimes, a single feature of your product, service, or business model will perform considerably better than the others around it. If that\'s the case for your company, explore the possibility of pivoting to support that single aspect exclusively. Your goal is to be as efficient as you can be — to work smarter and get the best possible returns for your effort.</p><p>Trimming as much fat from your business operations is one of the best ways to streamline production and, in turn, extract more value out of the time and capital you invest in your company. If you can identify a single feature of your product or service that your customers enjoy or leverage more than others, consider pivoting and building around it.</p><h4>2. The business isn\'t financially viable.</h4><p>Startup founders often have sentimental stakes in their businesses. Founding a startup is a matter of having both a new idea and the motivation to see to it that it\'s realized. That makes that pursuit inherently personal.</p><p>Despite what it might mean to you personally, a business can only go so far as its capital lets it. If your company is running out of money, you\'ll need to jump ship from the idea or processes behind it and pivot to something more financially viable.</p><p>Take an honest, objective look at your business — without accommodation or emotion — and see where you could be doing better. See what you can strip back, which aspects are burdening you financially, and where you might be able to go with the resources you have on hand. Use that information to identify a reference point for your pivot.</p><h4>3. The market didn\'t respond the way you\'d anticipated.</h4><p>The prospect of getting your product or service to market is exciting. It\'s a moment of truth, but you always have to account for the fact that the truth might hurt. Maybe, People won\'t be moved by your messaging. Maybe, you\'ll overestimate the scale of the problem your product or service addresses. Or maybe, your target audience just won\'t be willing to pay what you\'re charging.</p><p>Any case where your product or service doesn\'t resonate with consumers like you thought it would is cause for a pivot. One way or another, you have to change your business model to convey better value to your target audience.</p><p>Take strides to generate interest in your solution. That could mean lowering your price, focusing on further developing certain features, or changing your target market. Ultimately, you have to make consumers see your business in a new light.</p><h4>4. You\'re consistently being outperformed by the competition.</h4><p>The startup realm is a dog eat dog world. You\'re always going to be pitted against some kind of competition. If other companies are absolutely dominating your space — taking up business you need or confining you to a niche you\'re unhappy with — it\'s probably time for a pivot.</p><p>Your industry might be crowded. There could be too many companies in it to claim a significant enough portion of the market. Or, a single company could have a definitive grasp on your target audience. In both of these cases, you\'ll need to differentiate yourself. That means pivoting.</p><p>In this case, your pivot is going to be drastic. You\'ll need to radically alter your company and how it operates. You might have to change your product or service, cater your messaging to a new audience, or completely alter your sales strategy.</p><p>Pivoting to challenge your competition is a matter of becoming different — different from your competitors and different from your business as you know it.</p><h4>5. You just want something different.</h4><p>Say your startup has been operating for a while now, and you\'re becoming unhappy with the trajectory your business is on. Your perspective and goals might have shifted. You might have developed new values as your business has grown. Maybe, a lucrative niche you could appeal to might be emerging.</p><p>In any of those cases, some kind of pivot is a viable option. But be careful — this particular reason for pivoting is the trickiest to navigate. If your business is doing well, it could be risky to make a radical shift. Still, as a business owner, it\'s up to you to decide how your company operates. Do what you feel is right — whether that be a matter of your vision, morals, finances, or all three.</p><h2><strong>Successful Business and Startup Pivot Examples</strong></h2><p><a href="https://blog.hubspot.com/sales/organic-growth%3Estartup\'s%20business%20strategy%3C/a%3E,%20generally%20dictated%20by%20factors%20beyond%20its%20control.%3C/p%3E%20%3Ch3%3EWhen%20to%20Pivot%20a%20Startup%3C/h3%3E%20%3Cp%3EIt%20can%20be%20tricky%20to%20know%20when%20to%20pivot%20your%20business%20model.%20We%E2%80%99ve%20compiled%20a%20few%20reasons%20to%20help%20you%20evaluate%20whether%20or%20not%20one%20is%20right%20for%20your%20business.%3C/p%3E%20%3Ch4%3E1.%20One%20piece%20%3Cem%3Ereally%3C/em%3E%20stands%20out.%3C/h4%3E%20%3Cp%3ESometimes,%20a%20single%20feature%20of%20your%20product,%20service,%20or%20business%20model%20will%20perform%20considerably%20better%20than%20the%20others%20around%20it.%20If%20that\'s%20the%20case%20for%20your%20company,%20explore%20the%20possibility%20of%20pivoting%20to%20support%20that%20single%20aspect%20exclusively.%20Your%20goal%20is%20to%20be%20as%20efficient%20as%20you%20can%20be%20%E2%80%94%20to%20work%20smarter%20and%20get%20the%20best%20possible%20returns%20for%20your%20effort.%3C/p%3E%20%3Cp%3ETrimming%20as%20much%20fat%20from%20your%20business%20operations%20is%20one%20of%20the%20best%20ways%20to%20streamline%20production%20and,%20in%20turn,%20extract%20more%20value%20out%20of%20the%20time%20and%20capital%20you%20invest%20in%20your%20company.%20If%20you%20can%20identify%20a%20single%20feature%20of%20your%20product%20or%20service%20that%20your%20customers%20enjoy%20or%20leverage%20more%20than%20others,%20consider%20pivoting%20and%20building%20around%20it.%3C/p%3E%20%3Ch4%3E2.%20The%20business%20isn\'t%20financially%20viable.%3C/h4%3E%20%3Cp%3EStartups%20founders%20often%20have%20sentimental%20stakes%20in%20their%20businesses.%20Founding%20a%20startup%20is%20a%20matter%20of%20having%20both%20a%20new%20idea%20and%20the%20motivation%20to%20see%20to%20it%20that%20it\'s%20realized.%20That%20makes%20that%20pursuit%20inherently%20personal.%3C/p%3E%20%3Cp%3EDespite%20what%20it%20might%20mean%20to%20you%20personally,%20a%20business%20can%20only%20go%20so%20far%20as%20its%20capital%20lets%20it.%20If%20your%20company%20is%20running%20out%20of%20money,%20you\'ll%20need%20to%20jump%20ship%20from%20the%20idea%20or%20processes%20behind%20it%20and%20pivot%20to%20something%20more%20financially%20viable.%3C/p%3E%20%3Cp%3ETake%20an%20honest,%20objective%20look%20at%20your%20business%20%E2%80%94%20without%20accommodation%20or%20emotion%20%E2%80%94%20and%20see%20where%20you%20could%20be%20doing%20better.%20See%20what%20you%20can%20strip%20back,%20which%20aspects%20are%20burdening%20you%20financially,%20and%20where%20you%20might%20be%20able%20to%20go%20with%20the%20resources%20you%20have%20on%20hand.%20Use%20that%20information%20to%20identify%20a%20reference%20point%20for%20your%20pivot.%3C/p%3E%20%3Ch4%3E3.%20The%20market%20didn\'t%20respond%20the%20way%20you\'d%20anticipated.%3C/h4%3E%20%3Cp%3EThe%20prospect%20of%20getting%20your%20product%20or%20service%20to%20market%20is%20exciting.%20It\'s%20a%20moment%20of%20truth,%20but%20you%20always%20have%20to%20account%20for%20the%20fact%20that%20the%20truth%20might%20hurt.%20Maybe,%20People%20won\'t%20be%20moved%20by%20your%20messaging.%20Maybe,%20you\'ll%20overestimate%20the%20scale%20of%20the%20problem%20your%20product%20or%20service%20addresses.%20Or%20maybe,%20your%20target%20audience%20just%20won\'t%20be%20willing%20to%20pay%20what%20you\'re%20charging.%3C/p%3E%20%3Cp%3EAny%20case%20where%20your%20product%20or%20service%20doesn\'t%20resonate%20with%20consumers%20like%20you%20thought%20it%20would%20is%20cause%20for%20a%20pivot.%20One%20way%20or%20another,%20you%20have%20to%20change%20your%20business%20model%20to%20convey%20better%20value%20to%20your%20target%20audience.%3C/p%3E%20%3Cp%3ETake%20strides%20to%20generate%20interest%20in%20your%20solution.%20That%20could%20mean%20lowering%20your%20price,%20focusing%20on%20further%20developing%20certain%20features,%20or%20changing%20your%20target%20market.%20Ultimately,%20you%20have%20to%20make%20consumers%20see%20your%20business%20in%20a%20new%20light.%3C/p%3E%20%3Ch4%3E4.%20You\'re%20consistently%20being%20outperformed%20by%20the%20competition.%3C/h4%3E%20%3Cp%3EThe%20startup%20realm%20is%20a%20dog%20eat%20dog%20world.%20You\'re%20always%20going%20to%20be%20pitted%20against%20some%20kind%20of%20competition.%20If%20other%20companies%20are%20absolutely%20dominating%20your%20space%20%E2%80%94%20taking%20up%20business%20you%20need%20or%20confining%20you%20to%20a%20niche%20you\'re%20unhappy%20with%20%E2%80%94%20it\'s%20probably%20time%20for%20a%20pivot.%3C/p%3E%20%3Cp%3EYour%20industry%20might%20be%20crowded.%20There%20could%20be%20too%20many%20companies%20in%20it%20to%20claim%20a%20significant%20enough%20portion%20of%20the%20market.%20Or,%20a%20single%20company%20could%20have%20a%20definitive%20grasp%20on%20your%20target%20audience.%20In%20both%20of%20these%20cases,%20you\'ll%20need%20to%20differentiate%20yourself.%20That%20means%20pivoting.%3C/p%3E%20%3Cp%3EIn%20this%20case,%20your%20pivot%20is%20going%20to%20be%20drastic.%20You\'ll%20need%20to%20radically%20alter%20your%20company%20and%20how%20it%20operates.%20You%20might%20have%20to%20change%20your%20product%20or%20service,%20cater%20your%20messaging%20to%20a%20new%20audience,%20or%20completely%20alter%20your%20sales%20strategy.%3C/p%3E%20%3Cp%3EPivoting%20to%20challenge%20your%20competition%20is%20a%20matter%20of%20becoming%20different%20%E2%80%94%20different%20from%20your%20competitors%20and%20different%20from%20your%20business%20as%20you%20know%20it.%3C/p%3E%20%3Ch4%3E5.%20You%20just%20want%20something%20different.%3C/h4%3E%20%3Cp%3ESay%20your%20startup%20has%20been%20operating%20for%20a%20while%20now,%20and%20you\'re%20becoming%20unhappy%20with%20the%20trajectory%20your%20business%20is%20on.%20Your%20perspective%20and%20goals%20might%20have%20shifted.%20You%20might%20have%20developed%20new%20values%20as%20your%20business%20has%20grown.%20Maybe,%20a%20lucrative%20niche%20you%20could%20appeal%20to%20might%20be%20emerging.%3C/p%3E%20%3Cp%3EIn%20any%20of%20those%20cases,%20some%20kind%20of%20pivot%20is%20a%20viable%20option.%20But%20be%20careful%20%E2%80%94%20this%20particular%20reason%20for%20pivoting%20is%20the%20trickiest%20to%20navigate.%20If%20your%20business%20is%20doing%20well,%20it%20could%20be%20risky%20to%20make%20a%20radical%20shift.%20Still,%20as%20a%20business%20owner,%20it\'s%20up%20to%20you%20to%20decide%20how%20your%20company%20operates.%20Do%20what%20you%20feel%20is%20right%20%E2%80%94%20whether%20that%20be%20a%20matter%20of%20your%20vision,%20morals,%20finances,%20or%20all%20three.%3C/p%3E%20%3Ch2%3ESuccessful%20Business%20and%20Startup%20Pivot%20Examples%3C/h2%3E%20%3Cp%3E%3Ca%20rel="><strong>Willbur Labs,</strong></a> a San Francisco based startup studio, surveyed 150 founders and revealed 55% of them reported having to pivot their startups to avoid failure. Although less than half of the founders surveyed said they were optimistic at the start of the pivot process, 75% reported success. Let’s check out some successful business pivots below.</p><h3>1. <a href="https://www.instagram.com/"><strong>Instagram</strong></a></h3><p>The platform, as it currently exists, was born out of a service called <a href="https://www.investopedia.com/articles/investing/102615/story-instagram-rise-1-photo0sharing-app.asp"><strong>Burbn,</strong></a> a location-based check-in app.</p><p>After noticing the popularity of its photo-sharing capabilities, relative to its other features, Burbn\'s leadership stripped the application of virtually every other aspect — focusing exclusively on its photo, comment, and like functions. The business ultimately rebranded and became Instagram: the photo-sharing giant we know today.</p><p><strong>Why it worked: </strong>Instagram doubled down on what it did well and what was most popular with users, which enabled a successful pivot.</p><h3>2. <a href="https://feastin.com/"><strong>Feastin</strong></a></h3><p>When the pandemic struck, restaurants quickly had to adjust to a predominantly delivery-only model. Hannah Wagner and Sebastiaan Van De Rijt, owners of Northern California restaurant chain Bamboo Asia, sought to not only help restaurants stay afloat, but provide a delivery platform that gave them more autonomy. With that, Feastin was born.</p><p>Feastin delivers restaurant meals, meal kits, and groceries to customers throughout the Bay Area. Through their partnership with restaurants, farmers, and purveyors, customers are able to connect directly with local suppliers. Plus, unlike other delivery services, Feastin doesn’t charge restaurants and purveyors commissions, so restaurants keep more of what they earn and customers save since there’s no price markup to compensate for extra fees.</p><p><strong>Why it worked:</strong> Wagner and Van De Rijt were able to take their experience as restauranteurs and pivot to a new business model that solved for fellow restaurant owners and customers alike.</p><h3>3. <a href="https://www.netflix.com/"><strong>Netflix</strong></a></h3><p>While Netflix signaled the demise of brick and mortar video shops like Blockbuster with their convenient DVDs by mail model, they too found a need to pivot and continue to do so.</p><p>Streaming video and movies was becoming more popular and in 2007, Netflix started offering a plan that included streaming movies and television shows. Now streaming is the dominant method people consume content.</p><p>Netflix didn’t just stop at streaming. The company has also pivoted into creating its own content, launching Netflix original series<i> House of Cards</i> in 2013. <i>Orange is the New Black</i> was released shortly after, and now the streaming giant has created a successful model for other platforms to follow.</p><p>What will the company’s next iteration look like? We’ll have to wait and see.</p><p><strong>Why it worked:</strong> Netflix is always iterating on its product and capitalizing on new technologies to stay competitive and provide a better viewing experience for customers.</p><h3>4. <a href="https://www.pinterest.com/"><strong>Pinterest</strong></a></h3><p>Pinterest started off as a company called Tote, a mobile app meant to make shopping on your phone easier. It was 2009, and mobile shopping wasn’t as widespread as it is today.</p><p>The app flopped, due in part to mobile payment technology still being clunky, which prevented them from simplifying the mobile shopping experience. However, founders Ben Sillberman, Vikram Bhaskaran, and Paul Sciarra noticed Tote customers were creating large collections of “favorite” items they found online and sharing them with their friends.</p><p>In response, they created Pinterest, a medium that allows users to display and share photo collections of anything online. The platform quickly became popular and today it’s the 14th largest social media platform in the world, according to <a href="https://blog.hootsuite.com/pinterest-statistics-for-business/"><strong>Hootsuite</strong></a>.</p><p><strong>Why it worked:</strong> While the first iteration of the app was a bust, Pinterest founders were able to take what worked, and pivot their product to capitalize on a feature their users loved.</p><h3>5. <a href="https://slack.com/"><strong>Slack</strong></a></h3><p>It might be hard to believe that the popular chat app, Slack, started off as an online game. Glitch, the adventure game created by Stewart Butterfield, allowed players to inhabit the minds of giants and embark on quests with other players.</p><p>While the game had a small, but devoted following, Butterfield noticed that the players continuously talked to each other while playing. The game’s built-in messaging technology laid the groundwork for what would become Slack.</p><p>Butterfield is no stranger to turning failed games into startup gold. His first attempt, Game Neverending, went on to become Flickr. You could say he’s mastered the art of the pivot. Slack, now a messaging and productivity tool, has over $10M daily users.</p><p><strong>Why it worked</strong>: Slack saw the potential of their messaging technology and how it could be applied outside of their game to create a product used by millions.</p><h2><strong>Startup Pivot Process</strong></h2><p><img src="https://blog.hubspot.com/hs-fs/hubfs/Startup%20Pivot%20Process.jpg?width=650&amp;name=Startup%20Pivot%20Process.jpg" alt="Startup Pivot Process" srcset="https://blog.hubspot.com/hs-fs/hubfs/Startup%20Pivot%20Process.jpg?width=325&amp;name=Startup%20Pivot%20Process.jpg 325w, https://blog.hubspot.com/hs-fs/hubfs/Startup%20Pivot%20Process.jpg?width=650&amp;name=Startup%20Pivot%20Process.jpg 650w, https://blog.hubspot.com/hs-fs/hubfs/Startup%20Pivot%20Process.jpg?width=975&amp;name=Startup%20Pivot%20Process.jpg 975w, https://blog.hubspot.com/hs-fs/hubfs/Startup%20Pivot%20Process.jpg?width=1300&amp;name=Startup%20Pivot%20Process.jpg 1300w, https://blog.hubspot.com/hs-fs/hubfs/Startup%20Pivot%20Process.jpg?width=1625&amp;name=Startup%20Pivot%20Process.jpg 1625w, https://blog.hubspot.com/hs-fs/hubfs/Startup%20Pivot%20Process.jpg?width=1950&amp;name=Startup%20Pivot%20Process.jpg 1950w" sizes="100vw" width="650"></p><p>Let’s say you’ve recognized your business isn’t scaling as planned and know a pivot is necessary. Where should you start? We’ve outlined a process to help guide you along your transformation.</p><ol><li><strong>Discovery</strong>: This stage is similar to your initial <a href="https://blog.hubspot.com/service/customer-profiling"><strong>customer profile</strong></a> development, only now you’re using the data and feedback you’ve amassed while running your business. Use it to inform changes in your business model and product ideas.</li><li><strong>Development</strong>: Once you’ve established a new product idea, it’s time to develop a prototype. You’ll want to come up with something that has just enough viable features to attract early customers. This is also referred to as a minimum viable product (MVP). You’re going to be testing the product in the validation phase, so you don’t want to spend too much time and resources on development.</li><li><strong>Validation</strong>: Now that you’ve got your MVP, it’s time to test it. Reach out to customers for feedback and insights. Adjust and iterate on the product until you come up with something that customers will buy.</li><li><strong>Plan</strong>: You can’t pull off a successful pivot without a plan. Create a timeline to bring your new product to market. Make sure any necessary changes to branding and messaging are taken care of before launch.</li><li><strong>Execute</strong>: You’ve done all the groundwork. Now it’s time to execute your plan and launch.</li></ol><h2><strong>How to Pivot Your Business</strong></h2><p>While the examples above might make it seem like undergoing a business pivot is an easy task, pulling one off requires a lot of work. Here are a few tips to follow to ensure your startup pivot process is successful.</p><h3>1. Focus on what works.</h3><p>In the examples above, the founders were able to hone in on the most popular features of their product or tap into a functionality that was incredibly useful. Evaluate your business model and products. Keep the things that perform best.</p><h3>2. Inform and involve stakeholders.</h3><p>Talk to your startup’s investors. If you’re changing business directions, they’ll definitely need to know. Communicate the need for a business pivot to employees and get them onboard. They may even be able to provide insight on what features are most popular with customers, or what technology can be repurposed for something else.</p><h3>3. Act quickly and decisively.</h3><p>Once you’ve decided on a new business model or direction, get started immediately. Resources will need to be directed to new projects and a new brand strategy.</p><h3>4. Skill up if you need to.</h3><p>Undertaking a startup pivot may require learning a new skill set and new workforce. Ask yourself:</p><ul><li>What new skills do we need to learn to create a successful product?</li><li>What are our blind spots, and weaknesses?</li><li>Do we need to hire new people to achieve our new goals?</li></ul><h3>5. Get comfortable with change and embrace it.</h3><p>Pivoting your business model in such a dramatic way can be very risky and stressful. Letting go of previous failures will make the transition smoother. Sometimes, it may even feel like starting over from scratch. Embrace the newness and focus on recalibrating your business to make it the best it can be.</p><p>Pivoting your startup isn\'t a decision to take lightly. No matter what you choose to do, it\'s going to take considerable effort on your end. It\'s a tough call to make. It means being honest with yourself and any employees you might have about how you do business.</p><h2><strong>To Pivot, or Not to Pivot</strong></h2><p>Pivoting is a humbling process. It requires a real understanding of where your business is heading, and deciding on a potentially drastic course of action. Still, if your startup is radically underperforming or flat-out dead in the water, some kind of pivot may be necessary to stay in business.</p><p><i>This article was originally published in March 2020 and has been updated for comprehensiveness.</i></p><p><img src="https://f.hubspotusercontent00.net/hubfs/53/hub_generated/resized/775cb565-e971-428e-87ec-905f03e733c6.png" alt="New Call-to-action"></p>', 'when-why-and-how-to-pivot-a-startup-business-100005.webp', '1', NULL, '4', '2022-01-22 15:56:14', '2022-01-22 15:56:14' );
