( '109', 'Mold Removal Gel Bathroom Wall Cleaner', 'mold-removal-gel-bathroom-wall-cleaner', '100054', '<h3><strong>Rapid Mold Removal Gel Bathroom Wall Cleaner Household Cleaning Mold Remover.Powerful to Remove Any Mold Infestation.Contains Chemical Free, All Natural Organic Ingredients</strong></h3><h3><strong>Instructions</strong></h3><p>First step: Dry with a dry rag Moldy surface Second step: Completely cover at least 3mm moldy surface like a toothpaste Third step: Wait 4-8 hours No water in case of heat Wrapped in plastic wrap Fourth step: Until no mold is visible With water and rag Scrub clean Stubborn mold waiting for more than 12 hours If it is not clean once, use it at least 2 times.Until the mold is completely removed! <strong>Precautions</strong> 1. Keep indoor ventilation before use, wipe the moldy black surface with a rag, and the wet environment will affect the gel effect 2. To prevent the gel from hitting the hand when using it, you can wear rubber gloves. 3. If you are very sensitive to a little smell, you can wear a mask. 4.completely covered with moldy toothpaste at least 3mm in moldy black, do not wipe thin 5. Prevent gel flow, can be fixed with plastic wrap, the effect is better 6. Do not encounter water during the smear waiting for the heat to prevent deformation 7.waiting time can be extended to more than 12 hours and even longer until the mold completely disappears 8. If you encounter stubborn mold, do not remove it once, wipe it clean and repeat the operation. 9.After use, wipe the residual gel with a and rinse with plenty of water. 10. The gel is not used to remove yellow stains. Tiles on the yellow are recommended to use the tile&nbsp;cleaner. 11. Some glass glue is moldy inside, the mold remover can not penetrate the bottom of the glass glue, suggesting tools Remove the glass glue, then use the mold remover, the new glass glue 12. mold remover can only be used for PVC wallpaper, non-woven fabric and any cloth material only white Can be used 13. high temperature, freezing or direct light will reduce the viscosity of the product, must be covered after use In a cool and dry place, it is best to use it within 6 months after&nbsp;opening. 14. Invalid use of discoloration or contamination by metal components, do not touch colored clothing 15. Note that mold and gel are prohibited for aluminum products!</p><p><img src="https://orponbd.com/public/uploads/uploads/2019/10/2-4.jpg" alt="Mold removal"><img src="https://orponbd.com/public/uploads/uploads/2019/10/1-5.jpg" alt="Mold removal"><img src="https://orponbd.com/public/uploads/uploads/2019/10/3-2.jpg" alt="Mold removal"><img src="https://orponbd.com/public/uploads/uploads/2019/10/4-4.jpg" alt="Mold removal"><img src="https://orponbd.com/public/uploads/uploads/2019/10/5-3.jpg" alt="Mold removal"><img src="https://orponbd.com/public/uploads/uploads/2019/10/6-3.jpg" alt="Mold removal"></p>', '0', '450', '190', NULL, NULL, '2021-01-01 00:00:00', 'BMR-073', NULL, NULL, '1', NULL, '2', '1', '1', NULL, '0', '2021-10-26 12:55:08', '2021-10-26 12:58:36', NULL ),
