t 3 to 5 minutes, the liquid medicine is sprayed off the machine, take out the machine, continue the inner circulation for about 15 minutes, let it fully absorb.</p><p>The fourth step: ventilate, cycle outside for 3 minutes, the entire construction is completed, check the switch off, and deliver.</p><p>Tips</p><p>After the machine is finished, it is best to use clear water spray. Keep the machine piping clean and unobstructed to prevent blockages from affecting machine operation.</p><p>Cleaning function</p><p>Connect the machine to the power supply, press the black switch to the left cleaning position, turn the timing knob to about 2 steps, and rinse the machine pipe with clean water or clean tap water.</p><p><img src="https://orponbd.com/public/uploads/desc/1591885236-1591885227404.png"><img src="https://orponbd.com/public/uploads/desc/1591885232-1591885227989.png"><img src="https://orponbd.com/public/uploads/desc/1591885233-1591885228603.png"><img src="https://orponbd.com/public/uploads/desc/1591885231-1591885227940.png"><img src="https://orponbd.com/public/uploads/desc/1591885232-1591885227670.png"></p>', '3', '7000', '4500', NULL, NULL, '2021-01-01 00:00:00', 'SPFOGGM-130', NULL, NULL, '1', NULL, '2', '1', '1', NULL, '0', '2021-10-30 13:24:45', '2021-10-30 13:29:50', NULL ),
