( '403', 'Original Xiaomi Wifi Amplifier Pro 300Mbps Wifi Repeater', 'original-xiaomi-wifi-amplifier-pro-300mbps-wifi-repeater', '100173', '<p><strong>Xiaomi Mi WiFi Repeater Pro Extender 300Mbps Wireless Network Wireless Signal Enhancement Network Wireless Router</strong></p><p>Xiaomi Mi WiFi Repeater Pro is designed to extended WiFi coverage and strength the signal by repeating the signal from your home or office wireless router and redistributing. With up to 300Mbps speed and built in dual antennas, it eliminates WiFi dead zones and makes you enjoy seamless HD streaming, online gaming everywhere. It works with any standard WiFi router</p><p><img src="https://orponbd.com/public/uploads/desc/1593097438-01.jpg"></p><p><img src="https://orponbd.com/public/uploads/desc/1593097491-02.jpg"><img src="https://orponbd.com/public/uploads/desc/1593097515-03.jpg"><img src="https://orponbd.com/public/uploads/desc/1593097543-04.jpg"></p><p><img src="https://orponbd.com/public/uploads/desc/1593097568-Screenshot_1.jpg"></p><p><br>&nbsp;</p><p>&nbsp;</p><p><br>&nbsp;</p>', NULL, NULL, NULL, NULL, NULL, '2021-01-01 00:00:00', 'XIAOMIPROREPEATER-BLACK', NULL, NULL, '1', NULL, '2', '1', '1', NULL, '1', '2021-10-30 14:32:00', '2021-10-30 14:35:52', NULL ),
( '404', NULL, 'original-xiaomi-wifi-amplifier-pro-300mbps-wifi-repeater-100174', '100174', NULL, '0', '1200', '900', NULL, NULL, NULL, 'XIAOMIPROREPEATER-BLACK', NULL, '403', '1', NULL, NULL, '1', NULL, NULL, NULL, '2021-10-30 14:34:55', '2021-10-30 14:34:55', NULL ),
( '405', 'Wavefun XPods 3T Wireless Bluetooth 5.0 Earphones', 'wavefun-xpods-3t-wireless-bluetooth-50-earphones', '100175', '<p><img src="https://orponbd.com/public/uploads/desc/1593411316-1593411304926.png"></p><p><strong>Enjoy superior sound and voice quality</strong></p><p>CD Level Music Hearing wIth AptX Large Charging case with Wireless Charging Function CVC8.0 Clear Call and Voice Quality Automatically Switch Between Single and Dual mode</p><p><img src="https://orponbd.com/public/uploads/desc/1593411327-1593411324070.png"></p><p>All Wavefun XPods 3T customers have two lifetime effective chance to buy a 13usd XPods 3T accessories pack for only 6.5USD. &nbsp;one charging case, six sets of eartips ,and one charging cable are included in this accessories pack.</p><p><img src="https://orponbd.com/public/uploads/desc/1593411306-1593411304380.png"></p><p><strong>CD Level Music Hearing</strong></p><p>In order to achieve a CD level of hearing, Multiple audio formats are provided for XPods 3T Bluetooth earphone, such as apt-X and SBC. AptX audio technology can help users to hear everything as the artist intended.</p><p><img src="https://orponbd.com/public/uploads/desc/1593411340-1593411338290.png"></p><p><strong>Clearer Call and Voice Quality</strong></p><p>CVC8.0 noise cancellation tec,advanced structure design and component debugging bring advanced audio enhancements and noise suppression to the near and far end, and provides packet loss and bit error concealment. In combination, this delivers the best possible call quality.</p><p><img src="https://orponbd.com/public/uploads/desc/1593411341-1593411335549.png"></p><p><strong>Automatically Switch Between Single and Dual mode</strong></p><p>How to switch between single mode and dual mode has always been a headache for users of TWS headsets. The solution provided by XPods 3T is quite simple.After both R and L are connected to your phone, you can pick up any one of them to use as single mode. Then, it will automatically switch to dual mode, after you have pick up the other one.&nbsp;</p><p><img src="https://orponbd.com/public/uploads/desc/1593411313-1593411308508.png"></p><p><strong>Larger Capacity Charging Case with Wireless Charging Function</strong></p><p>Benefit from 6mA power consumption,the final listening time has increased to 6 hours of battery time after being fully charged.You can enjoy up to 45 hours of use with the updated 600 mAh battery capacity. What is more, as we integrate wireless charging into the charging box, you can charge your headset almost anytime, anywhere.</p><p><img src="https://orponbd.com/public/uploads/desc/1593411334-1593411323224.png"></p><p><strong>New Touch Interaction</strong></p><p>Benefit from the new upgraded touch operation.Now It is easy to operate the up and down songs,and adjust the volume just by XPods 3T earbuds.</p><p><img src="https://orponbd.com/public/uploads/desc/1593411308-1593411305663.png"></p><p><strong>Voice Command Made Simple</strong></p><p>You can instantly connect to Alexa,Siri or Google Now, which allows you to quickly receive the information you need</p><p><img src="https://orponbd.com/public/uploads/desc/1593411329-1593411315209.png"></p><p><strong>Built to Work and Guaranteed to Last</strong></p><p>XPods 3T feature an IPX7 rated design.Wherever your day takes you,your activities will not get in the way of easy, reliable access to calls and music.</p><p><strong>Package</strong></p><p><img src="https://orponbd.com/public/uploads/desc/1593411328-1593411310410.png"></p>', '0', '3100', '2700', NULL, NULL, '2021-01-01 00:00:00', 'Xpods-3T', NULL, NULL, '1', NULL, '2', '1', '1', NULL, '0', '2021-10-30 14:40:16', '2021-10-30 14:44:44', NULL ),
( '406', 'Wavefun Flex Pro Bluetooth 5.0 Earphone Fast Charging', 'wavefun-flex-pro-bluetooth-50-earphone-fast-charging', '100176', '<p><strong>Neckband Bluetooth Earphone</strong></p><p>Quick Charging Tech. （Flex Pro）</p><p>Clear &amp; Surround Sound</p><p>Magnetic Suction</p><p>Up to 10&nbsp;hours of music time</p><p>&nbsp;</p><p><img src="https://orponbd.com/public/uploads/desc/1593420240-1593420078871.png" alt="000"></p><p>&nbsp;</p><p><strong>Bass! Bass! Bass!</strong></p><p>Bluetooth 5.0 with &nbsp;CVC 8.0 Noise Cancelling</p><p>technology delivers true pure bass audio.</p><p>&nbsp;</p><p><img src="https://orponbd.com/public/uploads/desc/1593420214-1593420075357.png" alt="0"></p><p>&nbsp;</p><p><strong>Magnetic Suction</strong></p><p>When not wearing, magnetic earplugs</p><p>can&nbsp;prevent headphones tangled, easy to carry.</p><p>&nbsp;</p><p><img src="https://orponbd.com/public/uploads/desc/1593420213-1593420080090.png" alt="12"></p><p>&nbsp;</p><p><strong>IPX5 Sweat-resistant</strong></p><p>Nano Coating Ensures Flawless Performance</p><p>in the Rain and Sweat.</p><p>&nbsp;</p><p><img src="https://orponbd.com/public/uploads/desc/1593420108-1593420074410.png" alt="11"></p><p>&nbsp;</p><p><strong>Quick Charging Tech.(Flex Pro)</strong></p><p><strong>10 Hours Playing Time</strong></p><p>10mins charge, 5hrs&nbsp;continuously playing time</p><p>40 mins full charge, 10&nbsp;hrs playing time</p><p>&nbsp;</p><p><img src="https://orponbd.com/public/uploads/desc/1593420222-1593420074818.png" alt="9 "></p><p>&nbsp;</p><p><strong>Flexible &nbsp;Neckband</strong></p><p>The flexible neckband is easily</p><p>compactness with your neck, it\'s&nbsp;super light,&nbsp;</p><p>especially suitable&nbsp;for sports.</p><p>&nbsp;</p><p><img src="https://orponbd.com/public/uploads/desc/1593420076-1593420074026.png" alt="14"></p><p>&nbsp;</p><p><strong>Crystal Clear &amp; Surround Sound</strong></p><p>Wherever you go, whatever you do,</p><p>just enjoying the pure, clear music anytime and anywhere.</p><p>&nbsp;</p><p><img src="https://orponbd.com/public/uploads/desc/1593420120-1593420077210.png" alt="8"></p><p>&nbsp;</p><p><strong>&nbsp;Show</strong></p><p>&nbsp;</p><p><img src="https://orponbd.com/public/uploads/desc/1593420220-1593420079405.png" alt="6"></p><p>&nbsp;</p><p><img src="https://orponbd.com/public/uploads/desc/1593420218-1593420076334.png" alt="2"></p><p>&nbsp;</p><p><strong>package</strong></p><p>&nbsp;</p><p><img src="https://orponbd.com/public/uploads/desc/1593420109-1593420075877.png" alt="nnhnn-7_"></p><p>&nbsp;</p><p><strong>Parameters</strong></p><p>&nbsp;</p><figure class="table"><table><tbody><tr><td colspan="2"><strong>Main Parameters</strong></td></tr><tr><td>Brand</td><td>WAVEFUN</td></tr><tr><td>Model</td><td>Flex Pro &amp; Flex Pro</td></tr><tr><td>Color</td><td>Black</td></tr><tr><td>Bluetooth&nbsp;Version</td><td>Bluetooth 5.0</td></tr><tr><td>Processor</td><td>QCC3003</td></tr><tr><td>style</td><td>Flex neckband design</td></tr><tr><td colspan="2"><strong>Battery times</strong></td></tr><tr><td>Music /talking time</td><td>Up to 10&nbsp;hours</td></tr><tr><td>Charging time</td><td><p>Flex Pro: around 40 mins</p><p>Flex: 1.5-2 hrs</p></td></tr><tr><td colspan="2"><strong>Noise&nbsp;Reduction</strong></td></tr><tr><td>Noise&nbsp;Reduction version</td><td>DSP &amp; CVC8.0&nbsp;</td></tr><tr><td colspan="2"><strong>Battery Capacity</strong></td></tr><tr><td>Battery quantity</td><td>1 pcs</td></tr><tr><td>Battery capacity per pcs</td><td>120mAh</td></tr><tr><td>Whole Battery capacity</td><td>120mAh</td></tr><tr><td colspan="2"><strong>Buttons Functions</strong></td></tr><tr><td>Switch songs</td><td>Press Volume+ or Volume- for 2 sec</td></tr><tr><td>Reject a call</td><td>Press MFB for 2&nbsp;sec</td></tr><tr><td>Adjust volume</td><td>Press Volume+ or Volume -</td></tr><tr><td>Last number redial</td><td>Press MFB Twice</td></tr><tr><td colspan="2"><strong>Others</strong></td></tr><tr><td>Built-in Mic</td><td>yes</td></tr>