( '420', 'OnePlus Type-C Bullets Earphones', 'oneplus-type-c-bullets-earphones', '100186', '<p><strong>Original OnePlus Type-C Bullets Earphones &nbsp;OnePlus Bullets 2T In-Ear Headset With Remote Mic for Oneplus 6T Mobile Phone</strong></p><p>&nbsp;</p><p><strong>Main Features:</strong></p><p>Model: OnePlus Earphone 2T</p><p>Type: Type-C Jack Line Type(Straight)</p><p>Feature: With Mic &amp; Remote,Volume Control</p><p>Color: &nbsp;Black</p><p>Length: 1.15M</p><p>Impedance: 24Ω+/-15%</p><p>Sensitivity: 107dB (at 500Hz)</p><p>Frequency: 20Hz-20000Hz</p><p>Driver Uint: 9mm Dynamic</p><p>Maximum Power: 3mW</p><p>Cone material: PAR Polyarylate</p><p>Coil material: copper-clad aluminum</p><p>Wire core material: enamelled copper wire</p><p>Earphone weight: 14g</p><p>Compatible with:For Oneplus 6T</p><p>&nbsp;</p><p><strong>Package Included:</strong></p><p>1x &nbsp;Earphone</p><p>&nbsp;</p><p>Better Audio with a Built-in DAC.</p><p>&nbsp;</p><p>We’ve crafted a listening experience that’s immersive, vibrant, and extraordinarily detailed, thanks to an advanced internal DAC with high-res audio support. The speakers are fitted with a high-quality film diaphragm that makes voices sound more realistic and immediate, and the flat-wire cables are tangle-free and threaded with tough Karbon fiber.</p><p>&nbsp;</p><p><img src="https://orponbd.com/public/uploads/desc/1593437715-1593437712853.png"></p><p>Stay in Control. There’s no need to take out your phone every time you want to pause a song or answer a call, that’s what the three-button in-line remote control is for. The left and right channels reproduce sound independently, reducing noise and capturing each note perfectly. By removing the MIC signal from the channels, the quality of your phone calls is also significantly improved.</p><p><img src="https://orponbd.com/public/uploads/desc/1593437715-1593437712611.png"><img src="https://orponbd.com/public/uploads/desc/1593437716-1593437712675.png"></p><p>n the EQ settings, older OnePlus devices will recognize the Type-C Bullets earphones as “others”. This does not affect the operation of the earphones. &nbsp; &nbsp; The Sound of Quality. Before a pair of Bullets is considered ready for shipment, it has to undergo numerous rigorous quality tests. Traits like temperature resistance and plug durability are all put to the test, and only the earbuds that emerge from the tests in pristine condition are good enough for your ears.</p><p><img src="https://orponbd.com/public/uploads/desc/1593437715-1593437712331.png"><img src="https://orponbd.com/public/uploads/desc/1593437715-1593437712724.png"><img src="https://orponbd.com/public/uploads/desc/1593437715-1593437712200.png"><img src="https://orponbd.com/public/uploads/desc/1593437721-1593437714806.png"><img src="https://orponbd.com/public/uploads/desc/1593437724-1593437714122.png"></p>', '0', '1500', '1350', NULL, NULL, '2021-01-01 00:00:00', 'OPEP-BE02T', NULL, NULL, '1', NULL, '2', '1', '1', NULL, '0', '2021-10-31 11:39:12', '2021-10-31 11:42:31', NULL ),
( '421', 'COLMI S20 Smart Watch Men New Round Screen IP67 Life Waterproof Heart Rate Monitoring', 'colmi-s20-smart-watch-men-new-round-screen-ip67-life-waterproof-heart-rate-monitoring', '100187', '<p>Get empowered to make a change and embrace your fitness goals with activity tracker and sleep tracking, calories burned &amp; more on easy-to-use COLMI smart watch.</p><p>Sports: All-Day Activity Tracking, IP67 waterproof, 7 Exercise Modes, Stopwatch, Sports Data Report.</p><p>Health: 24/7 Heart Rate, Blood Pressure, Blood Oxygen, Sleep Tracking &amp; Stages, Reminders to Move.</p><p>Life: Smartphone Notifications, Alarm clock, Weather, Shutter, 3 watch faces.</p><p>With a battery life up to 7 days, keep the inspiration coming day and night.</p><p>&nbsp;</p><p><strong>SPECIFICATION</strong></p><p><strong>Brand:&nbsp;</strong>COLMI</p><p><strong>Model:&nbsp;</strong>S20</p><p><strong>Color:&nbsp;</strong>Black, Silver, Pink</p><p><strong>Chipset:&nbsp;</strong>HS6620D</p><p><strong>Wireless connectivity:&nbsp;</strong>Bluetooth 4.0 or above</p><p><strong>Requirements:&nbsp;</strong>Android 4.4, iOS 9.0 or above</p><p><strong>APP Name:&nbsp;</strong>Da Fit ( Google Play or APP Store )</p><p><strong>Message:&nbsp;</strong>Support all languages</p><p><strong>Watch language:&nbsp;</strong>Chinese, English, Russian, Spanish, Arabic, French, Thai</p><p><strong>APP language :&nbsp;</strong>English, Russian, Spanish, Portuguese, German, Italian, Czech, Japanese, French, Polish, Thai, Swedish, Ukrainian, Finnish, Dutch, Vietnamese, Arabic, Korean, Danish, Bulgarian, Bokmal, Norwegian, Hindi, Indonesian, Pashto, Simplified Chinese, Traditional Chinese.</p><p>&nbsp;</p><p><strong>TECHNICAL PARAMETERS</strong></p><p><strong>Sensors:&nbsp;</strong>Heart-rate Sensors, Proximity Sensor, Accelerometer</p><p><strong>Touchscreen type:&nbsp;</strong>Touch Screen</p><p>&nbsp;</p><p><strong>Screen:&nbsp;</strong></p><p>Screen Size: 1.28 inch</p><p>Display Type: IPS</p><p>Resolution: 240*240 RGB</p><p>Screen protection: tempered glass</p><p>&nbsp;</p><p><strong>Battery:</strong></p><p>Battery Capacity: 170 mAh</p><p>Standby Time: Up to 30 days</p><p>Using time: About 7 days</p><p>Charging Time: About 2.5 hours</p><p>Charging Type: Magnetic charging</p><p>&nbsp;</p><p><strong>Water Resistance Rating:&nbsp;</strong>IP67</p><p>&nbsp;</p><p><strong>FEATURES</strong></p><p>Sport Functions: 7 workout modes: walking, running, cycling, skipping, badminton, basketball, football; Count steps, distance, and calories burned.</p><p>Health monitoring: Workout completion notifications, goal setting, sleep monitoring, heart rate monitoring, Blood Pressure Monitor.</p><p>Other features: Alarm, proximity sensor, 3 watch faces, customizable watch face, timer, stopwatch, call notifications, message notifications, calendar notifications, app notifications, weather forecast, find my phone, Do not disturb mode , music controls, battery level display, different ways to wear, OTA updates.</p><p>&nbsp;</p><p><strong>APPEARANCE &amp; DETAILS</strong></p><p><strong>Watch Strap</strong></p><p>Type: Removable watch strap</p><p>Material: Silicone</p><p>Width: 20mm</p><p>Weight: about 11g</p><p>Adjustable length: 140 - 230mm</p><p>&nbsp;</p><p><strong>Watch</strong></p><p>Body material: alloy</p><p>Weight: about 54g</p><p>Body length: 45mm</p><p>Body width: 45mm</p><p>Device thickness: 11mm</p><p>Operating temperature: -10℃～50℃</p><p>&nbsp;</p><p><strong>PACKAGE CONTENTS</strong></p><p>Package contents</p><p>1 x COLMI S20 smart watch</p><p>1 x Charging cable</p><p>1 x User manual</p><p><img src="https://orponbd.com/public/uploads/desc/1593432403-1593432387760.png" alt="COLMI S20 SMARTWATCH"> <img src="https://orponbd.com/public/uploads/desc/1593432403-1593432387871.png" alt="COLMI S20 SMARTWATCH"> <img src="https://orponbd.com/public/uploads/desc/1593432397-1593432387130.png" alt="COLMI S20 SMARTWATCH"> <img src="https://orponbd.com/public/uploads/desc/1593432396-1593432390589.png" a