( '428', 'Tp-Link TL-WR841N 300Mbps Wireless N Speed Router', 'tp-link-tl-wr820n-300mbps-wireless-n-speed-router', '100192', '<h3><strong>Specification:</strong></h3><figure class="table"><table><thead><tr><th colspan="3"><strong>Wireless N Router</strong></th></tr></thead><tbody><tr><td><strong>Signal Rate</strong></td><td>11n: Up to 300Mbps(dynamic)<br>11g: Up to 54Mbps(dynamic)<br>11b: Up to 11Mbps(dynamic)</td><td>&nbsp;</td></tr><tr><td><strong>Warranty</strong></td><td>01 Year Warranty</td><td>&nbsp;</td></tr><tr><td><strong>Interface</strong></td><td>4 10/100Mbps LAN PORTS<br>1 10/100Mbps WAN PORT</td><td>&nbsp;</td></tr><tr><td><strong>Button</strong></td><td>WPS/Reset Button<br>Wireless On/Off Switch<br>Power On/Off Button</td><td>&nbsp;</td></tr><tr><td><strong>External Power Supply</strong></td><td>9VDC / 0.6A</td><td>&nbsp;</td></tr><tr><td><strong>Wireless Standards</strong></td><td>IEEE 802.11n, IEEE 802.11g, IEEE 802.11b</td><td>&nbsp;</td></tr><tr><td><strong>Frequency</strong></td><td>2.4-2.4835GHz</td><td>&nbsp;</td></tr><tr><td><strong>EIRP</strong></td><td>&lt;20dBm(EIRP)</td><td>&nbsp;</td></tr><tr><td><strong>Wireless Security</strong></td><td>64/128/152-bit WEP / WPA / WPA2,WPA-PSK / WPA2-PSK</td><td>&nbsp;</td></tr></tbody></table></figure><h2><strong>Description :</strong></h2><p>300Mbps Wireless N Router TL-WR841N is a combined wired/wireless network connection device designed specifically for small business and home office networking requirements. With 2T2R MIMO Technology, TL-WR841N creates an exceptional and advanced wireless performance, making it ideal for streaming HD video, making VoIP and online gaming. Also, Quick Setup Security (QSS) button on the sleek and fashionable exterior ensures WPA2 encryptions, preventing the network from outside intrusions.</p><p>01 Year Warranty</p>', '0', '1760', '1200', NULL, NULL, '2021-01-01 00:00:00', 'TP-Link TL-WR841N', NULL, NULL, '1', NULL, '2', '1', '1', NULL, '0', '2021-10-31 12:03:09', '2021-10-31 12:08:51', NULL ),
