( '430', 'Xiaomi Mi R2350 AIoT AC2350 Dual Band Gigabit 7 Antennas Router and Repeater', 'xiaomi-mi-r2350-aiot-ac2350-dual-band-gigabit-7-antennas-router-and-repeater', '100194', '<h3><strong>Specification:</strong></h3><figure class="table"><table><thead><tr><th colspan="3"><strong>Key Features</strong></th></tr></thead><tbody><tr><td><strong>Data Rate</strong></td><td>1167Mbps</td><td>&nbsp;</td></tr><tr><td><strong>Antenna</strong></td><td>7</td><td>&nbsp;</td></tr><tr><td><strong>Button</strong></td><td>1* WiFi on/off<br>1* Reset button</td><td>&nbsp;</td></tr><tr><td><strong>Frequency</strong></td><td>2.4GHz, 5GHz</td><td>&nbsp;</td></tr><tr><td><strong>Wireless</strong></td><td>Wireless router mode, AP mode, WISP mode, Universal repeater mode</td><td>&nbsp;</td></tr><tr><td><strong>Interface</strong></td><td>1*10/100Mbps WAN port+3*10/100Mbps LAN ports</td><td>&nbsp;</td></tr><tr><td><strong>Network Standard</strong></td><td>Wireless Standard: Wireless AC</td><td>&nbsp;</td></tr><tr><td><strong>Encryption</strong></td><td>WPA-PSK / WPA2-PSK, WPA / WPA2</td><td>&nbsp;</td></tr><tr><td><strong>Others</strong></td><td>Power: Power Input: 100-240V-50/60Hz 0.7A; Power Output: DC 12V == 2A</td><td>&nbsp;</td></tr><tr><td colspan="3"><strong>Physical Dimension</strong></td></tr><tr><td><strong>Color</strong></td><td>Black</td><td>&nbsp;</td></tr></tbody></table></figure><h2><strong>Description :</strong></h2><h2>Xiaomi Mi R2350 AIoT AC2350 Dual Band Gigabit 7 Antennas Router and Repeater</h2><p>Xiaomi has today cleared some products from the warehouse that are already available in China. For example, the company conjured up the Mi AIoT Router AX3600 from its hat. It already supports the new Wi-Fi 6 and is equipped with a chipset from Qualcomm. Felix had already blogged about this router for the release in China. AX3600 and AC2350 are two routers with Wi-Fi 6 wireless connectivity that can be paired with devices that support the new standard, such as MI 10 and MI 10 Pro. The first supports the simultaneous connection of up to 248 devices. It drops to 128 devices per second. If you want to spend less, Xiaomi will also add the Mi AIoT Router AC2350, which is already available for 49.99 euros. Here too, a SoC from Qualcomm is at the heart of the system and seven external amplifiers and seven independent antennas are used. There should be Wi-Fi speeds of up to 2,183 Mbps. MU-MIMO also supports this device.</p>', '0', '7500', '6800', NULL, NULL, '2021-01-01 00:00:00', 'Mi-R2350', NULL, NULL, '1', NULL, '2', '1', '1', NULL, '0', '2021-10-31 12:13:23', '2021-10-31 12:14:31', NULL ),
( '431', 'Xiaomi Mi 4A (Regular Edition) 1200Mbps Dual Band Global Version Router', 'xiaomi-mi-4a-regular-edition-1200mbps-dual-band-global-version-router', '100195', '<h3><strong>Specification:</strong></h3><figure class="table"><table><thead><tr><th colspan="3"><strong>Key Features</strong></th></tr></thead><tbody><tr><td><strong>Data Rate</strong></td><td>300Mbps</td><td>&nbsp;</td></tr><tr><td><strong>Antenna</strong></td><td>4</td><td>&nbsp;</td></tr><tr><td><strong>Button</strong></td><td>Reset Button</td><td>&nbsp;</td></tr><tr><td><strong>Frequency</strong></td><td>2.4 GHz and 5GHz</td><td>&nbsp;</td></tr><tr><td><strong>Interface</strong></td><td>LAN,WAN</td><td>&nbsp;</td></tr><tr><td><strong>Network Standard</strong></td><td>EEE 802.11a,IEEE 802.11ac,IEEE 802.11b,<br>IEEE 802.11g,IEEE 802.11n,IEEE 802.3,IEEE 802.3U,IPv6<br>Wireless AC</td><td>&nbsp;</td></tr><tr><td><strong>Encryption</strong></td><td>WPA-PSK,WPA2-PSK</td><td>&nbsp;</td></tr><tr><td><strong>Others</strong></td><td>Transmission Rate: 1167Mbps<br>Speed of Ethernet Port: 1000Mbps<br>Max. LAN Data Rate: 1000Mbps</td><td>&nbsp;</td></tr><tr><td colspan="3"><strong>Physical Dimension</strong></td></tr><tr><td><strong>Dimension</strong></td><td>20.10 x 17.40 x 12.20 cm</td><td>&nbsp;</td></tr><tr><td><strong>Weight</strong></td><td>0.2400 kg</td><td>&nbsp;</td></tr><tr><td><strong>Color</strong></td><td>White</td><td>&nbsp;</td></tr></tbody></table></figure><h2><strong>Description :</strong></h2><h2><strong>Xiaomi Mi 4A (Regular Edition) 1200Mbps Dual Band Global Version Router</strong><br>&nbsp;</h2><p>The Xiaomi MI 4A AC1200 Dual Band Router has single Core CPU with a dual core CPU and four threads. the frequency of a single core can reach 880MHz. Solid performance easily supports gigabit network and dual-band WiFi data transmission. It also has Wireless Dual Band, that supports two frequency bands of 2.4GHz and 5GHz. The maximum speed it can reach is 1167Mbps. The 2.4GHz band supports longer and better coverage and throughput through the wall. The 5GHz band uses 802.11ac technology. Less interference and high rate. Watch HD video and play the game without problems. The 4 high gain external omni-directional antennas greatly improves the performance of the transmission and does a great job in several complex environments. It has smart appliances that allows for more devices to connect and provides stable connection. Calculation of LDCP error correction of 5GHz frequency support. Strengthen anti-interference performance. Increase the WiFi signal and improve the transmission speed.</p>', '0', '2650', '2250', NULL, NULL, '2021-01-01 00:00:00', 'Mi-4A', NULL, NULL, '1', NULL, '2', '1', '1', NULL, '0', '2021-10-31 12:15:01', '2021-10-31 12:15:54', NULL ),
( '432', 'Netis W4 300Mbps 4 Antenna Router White', 'netis-w4-300mbps-4-antenna-router-white', '100196', '<h3><strong>Specification:</strong></h3><figure class="table"><table><thead><tr><th colspan="3"><strong>Key Features</strong></th></tr></thead><tbody><tr><td><strong>Data Rate</strong></td><td>Up to 300Mbps</td><td>&nbsp;</td></tr><tr><td><strong>Antenna</strong></td><td>4 * 5dBi Fixed Antenna</td><td>&nbsp;</td></tr><tr><td><strong>Button</strong></td><td>WPS, Default</td><td>&nbsp;</td></tr><tr><td><strong>Frequency</strong></td><td>2.4-2.4835GHz</td><td>&nbsp;</td></tr><tr><td><strong>Wireless</strong></td><td>IEEE 802.11b, IEEE 802.11g, IEEE 802.11n</td><td>&nbsp;</td></tr><tr><td><strong>Interface</strong></td><td>1 * 10/100Mbps Auto MDI/MDIX RJ45 WAN port<br>2 * 10/100Mbps Auto MDI/MDIX RJ45 LAN port</td><td>&nbsp;</td></tr><tr><td><strong>Network Standard</strong></td><td>IEEE 802.3 10Base-T, IEEE 802.3u 100Base-TX</td><td>&nbsp;</td></tr><tr><td><strong>Encryption</strong></td><td>64/128-bit WEP,<br>WPA-PSK/WPA2-PSK (TKIP/AES)<br>SSID Broadcast Enable/Disable<br>Wireless MAC Filtering</td><td>&nbsp;</td></tr><tr><td><strong>Ports</strong></td><td>3x RJ45 Ports</td><td>&nbsp;</td></tr><tr><td><strong>Others</strong></td><td>WAN Type: DHCP, Static IP, PPPoE, L2TP, PPTP, Dual Access, WISP<br>Port Forwarding: Virtual Servers, Port Triggering, UPnP, DMZ, FTP Private Port<br>QoS: WMM, Bandwidth Control<br>Access Control: IP/MAC/Domain Filtering<br>VPN Pass-through: PPTP, L2TP, IPSec<br>Others: IPTV, Dynamic DNS, Static Routing, WOL, Backup &amp; Restore, Firmware Upgrade</td><td>&nbsp;</td></tr><tr><td colspan="3"><strong>Power Source</strong></td></tr><tr><td><strong>Power Mode</strong></td><td>DC 9V/500mA (Output)</td><td>&nbsp;</td></tr><tr><td colspan="3"><strong>Physical Dimension</strong></td></tr><tr><td><strong>Color</strong></td><td>White</td><td>&nbsp;</td></tr><tr><td colspan="3"><strong>Manufacturer warranty</strong></td></tr><tr><td><strong>Warranty</strong></td><td>01 year warranty</td><td>&nbsp;</td></tr></tbody></table></figure><h2><strong>Description :</strong></h2><h2><strong>Netis W4 300Mbps 4 Antenna Router White</strong></h2><p>The Netis router W4 offers 300Mbps high speed to connect your computers, smartphones, wireless cameras, and other Wi-Fi devices. Bundled with enhanced four 5dBi high gain antennas, it ensures better wireless coverage and allows you to enjoy the wireless freedom anywhere around your home, ideal for faster downloading, Internet calling, and HD video streaming.</p>', '0', '1790', '1550', NULL, NULL, '2021-01-01 00:00:00', 'Netis-W4', NULL, NULL, '1', NULL, '2', '1', '1', NULL, '0', '2021-10-31 12:16:29', '2021-10-31 12:17:54', NULL ),
( '433', 'Mercusys MW302R 300mbps 2 Antenna Multi-Mode Wireless N Router', 'mercusys-mw302r-300mbps-2-antenna-multi-mode-wireless-n-router', '100197', '<h3><strong>Specification:</strong></h3><figure class="table"><table><thead><tr><th colspan="3"><strong>Key Features</strong></th></tr></thead><tbody><tr><td><strong>Data Rate</strong></td><td>11n: Up to 300Mbps (Dynamic)<br>11g: Up to 54Mbps (Dynamic)<br>11b: Up to 11Mbps (Dynamic)</td><td>&nbsp;</td></tr><tr><td><strong>Antenna</strong></td><td>2 x 5dBi</td><td>&nbsp;</td></tr><tr><td><strong>Button</strong></td><td>Reset Button</td><td>&nbsp;</td></tr><tr><td><strong>Frequency</strong></td><td>2.4 - 2.4835GHz</td><td>&nbsp;</td></tr><tr><td><strong>Wireless</strong></td><td>300Mbps Wireless N Router<br>WPA-PSK / WPA2-PSK<br>Wireless Functions: WDS bridge<br>Enable/Disable Wireless Radio, WDS Bridging<br>&nbsp;</td><td>&nbsp;</td></tr><tr><td><strong>Network Standard</strong></td><td>IEEE 802.11b/g/n<br>Guest Network: 2.4GHz guest network</td><td>&nbsp;</td></tr><tr><td><strong>Ports</strong></td><td>2 x 10/100Mbps LAN Ports &amp;<br>1 x 10/100Mbps WAN Port</td><td>&nbsp;</td></tr><tr><td><strong>Operating System Support</strong></td><td>Operating Temperature: 0°C~40°C (32°F~104°F)<br>Operating Humidity: 10%~90% Non-Condensing</td><td>&nbsp;</td></tr><tr><td colspan="3"><strong>Power Source</strong></td></tr><tr><td><strong>Power Mode</strong></td><td>External Power Supply: 5V/0.6A<br>Transmission Power: &lt;20dBm</td><td>&nbsp;</td></tr><tr><td colspan="3"><strong>Physical Dimension</strong></td></tr><tr><td><strong>Dimension</strong></td><td>114 x 94 x 26 mm<br><br>&nbsp;</td><td>&nbsp;</td></tr><tr><td><strong>Color</strong></td><td>White</td><td>&nbsp;</td></tr><tr><td colspan="3"><strong>Manufacturer warranty</strong></td></tr><tr><td><strong>Warranty</strong></td><td>01 Year Warranty</td><td>&nbsp;</td></tr></tbody></table></figure><h2><strong>Description :</strong></h2><h2><strong>Mercusys MW302R 300mbps 2 Antenna Multi-Mode Wireless N Router</strong></h2><p>This MW302R provides fast, stable Wi-Fi for all the connected devices of users. Wireless speed is of up to 300 Mbps to make it ideal for HD streaming, online gaming, and rapid file downloads. Besides, two external 5 dBi antennas powered with advanced antenna technology offers broader wireless coverage and signal intensity throughout large homes or offices. user can simply follow the step-by-step instructions on the intuitive webpage to get set up in an easier and faster way. Supervise children or staff by limiting access. Manage when and how connected devices can access the internet. Allows guest to join user\'s Wi-Fi network, while protecting your privacy. Makes sharing easy and maintaining security. Customizes a schedule to automatically turn off your Wi-Fi. WPA/WPA2 encryption creates an active defense against security threats and intruders.</p><p>The Multi-Mode Wireless N Router comes with 01 year warranty.</p>', '0', '1100', '750', NULL, NULL, '2021-01-01 00:00:00', 'MW302R', NULL, NULL, '1', NULL, '2', '1', '1', NULL, '0', '2021-10-31 12:18:28', '2021-10-31 12:21:45', NULL ),
