( '586', '1 MORE Dual Driver In-Ear Headphones ( E1017 ) – Black', '1-more-dual-driver-in-ear-headphones-e1017-black', '100270', '<figure class="table"><table><tbody><tr><th><strong>General</strong></th><td>Brand: 1MORE<br>Features: Extra Bass,Surround Sound<br>Function: Answering Phone,Microphone,MP3 player,Song Switching,Volume Control<br>Material: ABS,Metal<br>Model: E1017<br>Type: In-Ear<br>Wearing type: In-Ear</td></tr><tr><th><strong>Product Details</strong></th><td>Application: Running,Sport,Working<br>Cable Length (m): 1.25m<br>Compatible with: Computer,iPhone,iPod,Mobile phone,MP3,PC,Portable Media Player<br>Connecting interface: 3.5mm<br>Connectivity: Wired<br>Frequency response: 20 – 40KHz<br>Driver type: Dynamic<br>Impedance: 32ohms<br>Plug Type: L-Bend<br>Sensitivity: 98dB<br>Sound channel: Two-channel (stereo)</td></tr><tr><th><strong>Dimension and Weight</strong></th><td>Package size (L x W x H): 12.00 x 8.70 x 4.00 cm / 4.72 x 3.43 x 1.57 inches<br>Package weight: 0.2900 kg<br>Product size (L x W x H): 125.00 x 3.00 x 2.00 cm / 49.21 x 1.18 x 0.79 inches<br>Product weight: 0.0150 kg</td></tr><tr><th><strong>Package Contents</strong></th><td>Package Contents: 1 x Pair of Earphones, 1 x Cable Winder, 1 x Cable Clip,<br>1 x Storage Bag, 3 x Pair of Eartips, 1 x English User Manual</td></tr></tbody></table></figure><p><img src="https://orponbd.com/public/uploads/desc/1595743004-1595742999398.png" alt="1 MORE E1017 Double Driver In-ear Earphones Universal 3.5mm Earbuds with Mic and In-line Control - Black"></p><p>&nbsp;</p><p><img src="https://orponbd.com/public/uploads/desc/1595743010-1595742999911.png" alt="1 MORE E1017 Double Driver In-ear Earphones Universal 3.5mm Earbuds with Mic and In-line Control - Black"></p><p><img src="https://orponbd.com/public/uploads/desc/1595743004-1595742999266.png" alt="1 MORE E1017 Double Driver In-ear Earphones Universal 3.5mm Earbuds with Mic and In-line Control - Black"></p><p><img src="https://orponbd.com/public/uploads/desc/1595743005-1595742999628.png" alt="1 MORE E1017 Double Driver In-ear Earphones Universal 3.5mm Earbuds with Mic and In-line Control - Black"></p><p><img src="https://orponbd.com/public/uploads/desc/1595743004-1595742999587.png" alt="1 MORE E1017 Double Driver In-ear Earphones Universal 3.5mm Earbuds with Mic and In-line Control - Black"></p><p><img src="https://orponbd.com/public/uploads/desc/1595743007-1595742999852.png" alt="1 MORE E1017 Double Driver In-ear Earphones Universal 3.5mm Earbuds with Mic and In-line Control - Black"></p><p>&nbsp;</p><p>&nbsp;</p><p><img src="https://orponbd.com/public/uploads/desc/1595743042-1595743000095.png" alt="1 MORE E1017 Double Driver In-ear Earphones Universal 3.5mm Earbuds with Mic and In-line Control - Black"></p><p>&nbsp;</p><p><img src="https://orponbd.com/public/uploads/desc/1595743032-1595743001667.png" alt="1more dual driver"></p><p><img src="https://orponbd.com/public/uploads/desc/1595743014-1595743001774.png" alt="1morer dua driver"></p><p><img src="https://orponbd.com/public/uploads/desc/1595743014-1595743001745.png" alt="1more dual driver"></p><p>1MORE E1017 Specification</p><ul><li>Type: In-Ear</li><li>Weight: 15 g</li><li>Length: 1.25 m</li><li>Plug: 3.5 mm</li><li>Impedance: 32 Ω</li><li>Sensitivity: 98 dB</li><li>In-line Control Box &amp; Microphone: Included</li></ul><h3>1MORE E1017 Dual Driver Earphones</h3><h4>Superior sound using two drivers</h4><p>A balanced armature and a separate graphene driver deliver a powerful yet intimate listening experience. Our balanced armature (mini-tweeter) produces clear highs and is uniquely inset with a durable silicone cover for lasting performance and clarity. Our graphene driver (mini-speaker) greatly increases midrange definition and deep bass.</p><ul><li>Well balance among mids, highs and bass</li><li>Female vocalists sound great</li><li>Clear and warm human voice with minimized dental sound</li><li>Suitable for pop songs, string music and absolute music</li><li>Hi-Res audio with the purity of music</li></ul><h3>Pure and balanced audio</h3><figure class="table"><table><thead><tr><th><img src="https://orponbd.com/public/uploads/desc/1595743032-1595743001837.png" alt="1more dual driver"></th><th><img src="https://orponbd.com/public/uploads/desc/1595743032-1595743001807.png" alt="1more dual driver"></th><th><img src="https://orponbd.com/public/uploads/desc/1595743015-1595743002359.png" alt="1more dual driver"></th></tr></thead><tbody><tr><td><h4>Sonic Balance</h4><p>Unlike the harsh bass or treble boosting prevalent with other brands, our headphones produce an evenly balanced frequency response to deliver a precise representation of the artist’s intended sound. The angled ergonomic fit with multiple ear tip options ensure comfort, noise isolation, and deep bass.</p></td><td><h4>Hi-Res Certified</h4><p>Hi-Res certified, our Dual Drivers have an extended frequency range of 40,000 Hz. The music industry is transitioning towards Hi-Res audio and our Dual Drivers are suited perfectly for this trend.</p></td><td><h4>Stay In Control</h4><p>All functions are at your fingertips with the in-line control box, housing a mic, volume controls, tracks circling and playback functionality. Seamless switches with fast and precision react.</p></td></tr></tbody></table></figure><h3>Comfortable and durable housing</h3><figure class="table"><table><thead><tr><th><img src="https://orponbd.com/public/uploads/desc/1595743040-1595743003421.png" alt="1more dual driver"></th><th><img src="https://orponbd.com/public/uploads/desc/1595743040-1595743002913.png" alt="1more dual driver"></th><th><img src="https://orponbd.com/public/uploads/desc/1595743044-1595743003468.png" alt="1more dual driver"></th></tr></thead><tbody><tr><td><h4>Lightweight Yet Durable</h4><p>A comfort-length, Kevlar fiber wrapped and TPE braided cable keeps it tangle-free for compact portability, plus an improved 3.5 mm L plug for better durability and security.</p></td><td><h4>Cutting Edge Design</h4><p>A perfected ergonomic fit and lightweight aluminum alloy body provide enhanced comfort and durability while still having an aesthetic appeal. An improved “L” shaped 3.5 mm plug adds extra security.</p></td><td><h4>Expertly Tuned</h4><p>Masterfully tuned by Luca Bignardi – Grammys recording director, these earphones deliver enhanced tonality across a broad range of music genre, warmly and emotionally.</p></td></tr></tbody></table></figure><figure class="table"><table><thead><tr><th>&nbsp;</th><th>Click Here</th><th>Click Here</th><th>Click Here</th><th>Click Here</th></tr></thead><tbody><tr><th>&nbsp;</th><th><img src="https://orponbd.com/public/uploads/desc/1595743032-1595743003501.png"></th><th><img src="https://orponbd.com/public/uploads/desc/1595743032-1595743003527.png"></th><th><img src="https://orponbd.com/public/uploads/desc/1595743032-1595743003554.png"></th><th><img src="https://orponbd.com/public/uploads/desc/1595743032-1595743005772.png"></th></tr><tr><th>Drivers</th><th>3</th><th>4</th><th>2</th><th>3</th></tr><tr><th>Frequency</th><th>20-40,000 Hz</th><th>20-40,000 Hz</th><th>20-40,000 Hz</th><th>20-40,000 Hz</th></tr><tr><th>Cable</th><th>3.5 mm tangle-free cable with Kevlar fiber</th><th>3.5 mm tangle-free cable with Kevlar fiber, L plug</th><th>3.5 mm tangle-free cable with Kevlar fiber, L plug</th><th>Oxygen-free copper cable, detachable and tangle-free</th></tr><tr><th>Comfort</th><th>Super comfort with 8 sets of ear tips; 18 g</th><th>Super comfort with 8 sets of ear tips; 18.5 g</th><th>Great comfort with 3 sets of ear tips; 15 g</th><th>Super comfort with protein leather headband and ear pads; 293 g</th></tr><tr><th>Suitable Music Genre</th><th>Pop music, folk song, jazz, orchestral music</th><th>Pop music, classical music, symphony, jazz, rock</th><th>Pop music, string music, absolute music</th><th>Pop music, jazz, rock, EDM</th></tr><tr><th>Suitable Occasions</th><th>Travel by car, train, airplane; listen at home, office, street</th><th>Travel by car, train, airplane; listen at home, office, street</th><th>Listen at home, office, street, subway, coffee bar</th><th>Game, listen, record at home or studio</th></tr><tr><th>Suitable Listener</th><th>Music fancier or audiophile</th><th>Music fancier, audiophile, demanded musician</th><th>Basically anyone</th><th>DJ, recording director, musician, audiophile</th></tr><tr><th>Sound Signature</th><th>Full range sound with well balance</th><th>Hi-Fi sound with large soundstage</th><th>Detailed sound with enhanced highs and mids</th><th>Hi-Fi sound with rich bass</th></tr></tbody></table></figure><p>&nbsp;</p><p>[UPDATED] For most westerners, 1More is not a familiar manufacturer but they’re fairly well established in Asia. That’s something 1More are hoping to build on as they push their range of audio devices through Europe and the US and with a wide range of earphones and headsets already established 1More have a bit of a step-up compared to new players in these regions. We have got our hands on one of their mid-range earphone sets, the E1017 Dual Driver In-Ear Headset which, as you might expect from the name, contains not just a dynamic driver but also an additional balanced armature driver among a host of other features. So let’s dig in and see how they compare to more established brands in an already crowded marketplace.</p><p>We shall start in time-honoured tradition with a look at the specifications to see exactly what we’re getting and then take a look at the product itself.</p><h2><strong>Specifications</strong></h2><ul><li>NAME: Dual Driver</li><li>MODEL: E1017</li><li>COLOUR: Black</li><li>EAN: 6933037251357</li><li>TYPE: In-Ear</li><li>PLUG: 3.5 mm</li><li>SENSITIVITY: 98 dB</li><li>FREQUENCY RANGE: 20~40,000 Hz</li><li>IMPEDANCE: 32 Ω</li><li>CABLE MATERIAL: Enamelled Copper Wire</li><li>CABLE LENGTH: 1.25 m</li><li>IN-LINE CONTROL: Included w/ Mic</li><li>WEIGHT: 15 g</li><li>RATED POWER: 5 mW</li></ul><h2><strong>Closer Look</strong></h2><p>&nbsp;</p><p>1More present the E1017 headset rather nicely, the front of the outer sleeve is not crammed with information but simply shows a nice image of the earbuds along with some branding and the product name. A small Hi-Res Audio logo draws your attention to these being of better audio quality than standard headsets and a simple statement repeated in a couple of languages explains what you are looking at.</p><p>&nbsp;</p><p>Around the back of the outer sleeve, things are not quite as clean and clear. The use of grey text that fills the panel with a total of nine languages makes finding the right text and reading it harder than it needs to be. The bottom of the panel, again in grey text, give the specifications of the headset, this time in Chinese and English. Rounding off the back panel we have some regulatory logos for compliance.</p><p>&nbsp;</p><p>Slipping off the outer cover and we have a clean white box with a simple graphics and a slogan that it quite appealing.</p><p>&nbsp;</p><p>Once we reach the product itself we are greeted by the headset in its own plastic clamshell box and a further cardboard box with the shirt clip attached and, according to the graphic, there is a carry pouch inside.</p><p>&nbsp;</p><p>Laying out all the contents we can see a very nice selection of items to consider. The headset itself is contained in a silicon unit that fits inside the plastic clamshell, with that removed we can see three pairs of earbud tips that range in size. Also included is that carry pouch which has a magnetic opening to ensure that the headset is easy to get to but won’t fall out when stored. There’s a bunch of paraphernalia also included, the information guide is multilingual, there is a small introduction to the other products that 1More make and rounding things off is a vinyl sticker.</p><p>&nbsp;</p><p>The silicon unit that houses the headset is rather unusual in itself. You get to clearly see the earbuds from the front and back as well as the buttons of the control unit before you unpack it and the cabling is wound around the outside with the jack neatly tucked away. I think this would perhaps be a better travel solution than using the included pouch although you sacrifice keeping the tips clean for the convenience of not having any tangles in the cable.</p><p>&nbsp;</p><p>Finally released from all that packaging though we can get a proper look at the headset. The first thing I noticed as I was unwinding the cable was how remarkably thin it is. The cable has been coated in enamel to give it better resistance to wear and tear and that meant that the wire itself doesn’t need to be so thick. There is also a very nice braid made with Kevlar on the cable – well, on most of the cable – that should also go a long way to making sure that this product lasts and lasts. From the y-section up to the earbuds though we lose that braid and instead have a rubberised coating. The control box sits on the left-hand cable.</p><p>&nbsp;</p><p>Looking at the business end of the headset we can see a somewhat large body to the earbud which is made from an aluminium alloy. This further helps toward weight-saving, and with that thin cable, the whole unit come in at just 15 grams. The dynamic driver which has a graphene diaphragm is housed in the body of the earbud.</p><p>&nbsp;</p><p>The earbud’s tip is slightly angled backwards to match the natural shape of the ear canal which provides a more secure and comfortable fit which means you can wear them for longer without irritation and also helps block out background noise. The second driver, a balanced armature driver that acts as a tweeter is squeezed into the ear tip stalk. there are four pairs of silicone tips included to help you get the best fit possible and I can’t emphasise enough the comfort and performance benefits of just taking a couple of minutes to find the right fit for you.</p><p>&nbsp;</p><p>The control box for the Dual Driver In-Ear Headset is located halfway down the left cable forming the top of the Y. It allows mobile users to adjust volume (not available on iOS) as well as call answering, track selection, play and pause.</p><p>&nbsp;</p><p>For input, the headset features a microphone on the rear of the control box.</p><p>&nbsp;</p><p>Moving on to the other end of the headset and the beautifully braided cable terminates with a right-angled 3.5mm 4-pole jack with gold plated contacts. Comparing the jack to the cable highlights just how thin the wiring is on this unit.</p><h2><strong>1More Dual Driver In-Ear Headphones Performance</strong></h2><p>Unboxing the E1017 headset was pleasant enough, it’s obvious that a lot of thought has gone into the design to give consumers a little more than the product they are buying. It was immediately apparent that the thin cable used was indeed very thin, Even though it’s braided it comes in at just 1.5mm diameter. This goes a long way toward saving weight however I was concerned about longevity and the tendency for wires to snap inside the cable causing deterioration of the sound quality and eventually the death of the headset.&nbsp;A bit more research on the enamelled cables put those fears to rest as the wires should be at least as strong as the usual thicker wires found on headsets.</p><p>It’s rare for someone to actually be able to tell the difference between high-end audio output but at the more consumer-friendly end of things, the quality of the audio produced becomes a little more obvious – even to me. It is also important to also note that the sound produced by the headset is reliant on the device used to produce the sound – so a song played through a mobile phone for example may sound different to that played through a PC, especially if you have a powerful DAC attached. This headset does not come with a PC converter, so it’s obvious that the target audience is those using mobile devices whether that’s a laptop, phone or MP3 player (remember those?) and so for most of my testing I used my Samsung Galaxy S7 and HP Envy x360, neither of which are well known for audiophile quality output, and a little testing on my desktop PC with it’s Sound Blaster Z sound card which should give the best case scenario.</p><p>Using the headset on the go was really enjoyable for listening to tunes through Spotify as well as those stored on the phone, the quality was right up there with any headphones I’ve used, even with a higher price point which is a testament to the two drivers used. Rather than having a single driver compete with itself to produce the full range of sound, the additional&nbsp;balanced armature driver handles the highs while the Graphene diaphragm of the main driver gives out a great balance of bass and mid tones all without any distortion regardless of the volume. On the comfort side of things, I ended up using a much smaller earbud than I had expected to which still provided great comfort but also stability while on the move – I can’t recall any time where I had to remove the earbuds to rest my ears nor did they ever fall out unexpectedly.</p><p>Of course, using a wired headset while out and about is going involve not using it, and it’s during those periods of being stuffed into a pocket when the tangle fairy visits. The braiding on the cable effectively eliminated the problem of that section of cable being tangled but unfortunately the decision not to braid the upper section and leave it with a somewhat sticky texture destroyed all the good work of the lower braid and was a tangle celebration. I really hope that 1More consider adding the smooth braiding to the whole of the unit in future editions as it really is an oversight of dramatic proportions.</p><p>Back to audio quality and still mobile, when taking a call there was no problems with distortion or cutouts and I was able to hear the other party clearly… the same cannot be said of the mic quality, however, which is as bad if not worse than any in-line mic that I’ve used before. With just a simple pin-hole on the back of the control box, I was constantly having to hold the cable and try to speak into the mic so that the other party was able to hear me at all, let along clearly make out what I was saying. When transferred over to the PC and playing games while chatting on Discord the same problem was evident – the other people in the chat simple couldn’t make out what I was saying unless I really powered up my output volume AND they boosted my volume a lot on their side. The end result of all that mic boost was terrible clarity.</p><p>Listening to playback on the PC however was pretty great, with rock or heavy metal playing in the background I was able to easily distinguish in-game sounds and dialogue and while working or surfing the net I was able to enjoy a very high level of clarity in a range of music. Watching movies or the Formula 1 was another experience where I would expect a headset of this price range to start to distort if the volume was pushed too high but even at the limit there was no problem discerning dialogue even when the race was in full effect or there were dramatic, explosive scenes (mostly in the movies, though there were a couple of F1 crashes).</p><h2><strong>1More Dual Driver In-Ear Headphones: The Verdict</strong></h2><h3><strong>What’s Hot:</strong></h3><ul><li>Great audio quality and clarity at all volume ranges</li><li>Good balance of bass, mids and highs</li><li>Incredibly comfortable, lightweight and earbuds don’t fall out</li></ul><h3><strong>What’s Not:</strong></h3><ul><li>Poor mic quality</li><li>Only half the cable is braided leading to tangles</li><li>Often priced well above MSRP</li></ul>', '0', '2850', '2350', NULL, NULL, '2021-01-01 00:00:00', 'MDD-E1017', NULL, NULL, '1', NULL, '2', '1', '1', NULL, '0', '2021-11-03 10:55:34', '2021-11-03 10:58:08', NULL );
