( '1002', 'Fulkopi (Cauliflower)', 'fulkopi-cauliflower', '100477', '<p>"Cauliflower is as good a source of fiber and vitamins.</p><p>Its ingredients may help strengthen bones, boost the cardiovascular system, and prevent cancer.</p><p>Tasty ways of eating cauliflower include cauliflower crust pizza and cauliflower and cheese soup.</p><p>People who are using blood thinners should not suddenly start eating a lot of cauliflower because the high levels of vitamin K could react adversely with the drugs."</p><p>&nbsp;</p><p>Nutritional facts/Ingredients :</p><p>"Benefits:</p><p>-Helps With Digestion</p><p>-Helps Fight Cancer</p><p>-Sharpen Your memory</p><p>-Makes your bones Stronger</p><p>"</p>', '392', '80', '50', NULL, NULL, '2021-12-13 00:00:00', 'orp8', NULL, NULL, '1', NULL, NULL, '2', '1', NULL, '0', '2021-12-15 17:43:59', '2022-01-01 09:44:06', NULL ),
( '1003', 'Boro Alu (Big Diamond Potato) ± 50 gm', 'boro-alu-big-diamond-potato-50-gm', '100478', '<p>Potato is a very healthy food and popular vegetable all over the world. Potatoes are available year-round as they are harvested somewhere every month of the year. potato\'s have lots of variety. these Potatoes are comparatively bigger than regular Potatoes. potatoes contain a goodly amount of carbohydrate (starch and sugar) they are also a storehouse for many vitamins and minerals. With the exception of vitamin A, potatoes have at least some of just about every nutrient, including fiber. Potatoes are relatively low in calories.</p>', '487', '30', '20', NULL, NULL, '2021-12-01 00:00:00', 'orp9', NULL, NULL, '1', NULL, NULL, '2', '1', NULL, '0', '2021-12-15 17:45:53', '2022-01-01 09:44:06', NULL ),
( '1004', 'Lal Shak (Red Spinach)', 'lal-shak-red-spinach', '100479', '<p>Red Spinach is common vegetable in Bangladesh. Its leaves are usually round, thick, and rich green in color, but has a bright red colored central stem. The leaves and stems of red spinach contain a red liquid. This has a sweet, raw flavor and the texture is very delicate. Red spinach helps in the process of bowel movement since it contains a lot of fiber. This fibrous food helps in proper digestion and is useful for curing colon cancer, diabetes, cholesterol as well as for weight loss. Red spinach can be eaten in many ways. They can be consumed either raw or cooked. You can sauté them, use as salad leaves, mix in vegetables, fruits, eggs, nuts, pasta or cheese. This is used widely in Indian recipes with added flavors of spices, ginger, garlic, onions, creams, and chilies. You can also store them dry and refrigerated for about one to two weeks.This is all about red spinach recipe!</p>', '300', '30', '20', NULL, NULL, '2021-12-13 00:00:00', 'orp10', NULL, NULL, '1', NULL, NULL, '2', '1', NULL, '0', '2021-12-15 17:47:23', '2021-12-15 17:49:35', NULL ),
( '1005', 'Potol (Pointed Gourd) ± 25 gm', 'potol-pointed-gourd-25-gm', '100480', '<p>Potol generally collected from locally source. Potol which is known as a Pointed gourd. Pointed gourd is a very tasty vegetable as well as cheap. Various kind of dishes can be made by Pointed gourd like boiled for stews or soups, cooked as curries or fries, and many more. There are many health benefits of eating Pointed gourd. The vegetable is rated as one of the nutritious foods and is offering vitamins like vitamin A, vitamin B1, vitamin B2 and vitamin C. Calcium provides pointed gourd also offers you very less calories and hence it helps to keep the cholesterol levels in control.</p>', '16', '40', '30', NULL, NULL, '2021-12-10 00:00:00', 'orp11', NULL, NULL, '1', NULL, NULL, '2', '1', NULL, '0', '2021-12-15 17:50:12', '2021-12-22 11:54:54', NULL ),
( '1006', 'Roshun (Garlic Imported) ± 25 gm', 'roshun-garlic-imported-25-gm', '100481', '<p>Garlic is an excellent source of minerals and vitamins that are essential for optimum health. The bulbs are one of the richest sources of potassium, iron, calcium, magnesium, manganese, zinc, and selenium. Selenium is a heart-healthy mineral, and is an important cofactor for antioxidant enzymes within the body.</p>', '300', '90', '70', NULL, NULL, '2021-12-20 00:00:00', 'orp12', NULL, NULL, '1', NULL, NULL, '2', '1', NULL, '0', '2021-12-15 17:51:08', '2021-12-15 17:51:58', NULL ),
( '1007', 'Deshi Shosha (Local Cucumber) ± 25 gm', 'deshi-shosha-local-cucumber-25-gm', '100482', '<p>Locally sourced.Few foods are as cool as a cucumber.While most people think of cucumbers as vegetables, they are actually a fruit.Cucumbers are naturally low in calories, carbohydrates, sodium, fat and cholesterol &amp; hydrating properties.</p>', '499', '180', '150', NULL, NULL, '2021-12-23 00:00:00', 'orp13', NULL, NULL, '1', NULL, NULL, '2', '1', NULL, '0', '2021-12-15 17:53:14', '2022-01-19 15:38:05', NULL ),
( '1008', 'Dheros (Ladies Finger) ± 25 gm', 'dheros-ladies-finger-25-gm', '100483', '<p>Stewed okra is great, but for a little variety, we like to roast ours from time to time. This is so simple and easy and the okra tends to not be nearly as gummy or slimy when roasted. Chopped tomato, onion and some spices makes for great additions too.</p>', '199', '80', '50', NULL, NULL, '2021-12-08 00:00:00', 'orp14', NULL, NULL, '1', NULL, NULL, '2', '1', NULL, '0', '2021-12-15 17:54:20', '2022-01-20 13:31:21', NULL ),
( '1009', 'Kacha Pepe (Green Papaya) ± 70 gm', 'kacha-pepe-green-papaya-70-gm', '100484', '<p>Locally Sourced.Deliciously sweet with musky undertones and a soft, butter-like consistency, it is no wonder the papaya was reputably called the \'fruit of the angels\' by Christopher Columbus. Once considered quite exotic, they can now be found in markets throughout the year. Although there is a slight seasonal peak in early summer and fall, papaya trees produce fruit year round.</p>', '397', '30', '20', NULL, NULL, '2021-12-16 00:00:00', 'orp15', NULL, NULL, '1', NULL, NULL, '2', '1', NULL, '0', '2021-12-15 17:55:37', '2022-01-20 13:31:21', NULL ),
( '1010', 'Lomba Lebu (Long Lemon)', 'lomba-lebu-long-lemon', '100485', '<p>Locally Sourced.Locally Sourced.From treating throat infections to aiding digestion, Lemons are a great natural remedy. The distinctive sour taste of lemon juice is used to flavour a variety of food and beverages and the rind (zest) can also be used in cooking and baking. Lemons can be stored at room temperature for up to a week and in a fridge for up to a month. Tip: microwave for 10 seconds and roll on counter top applying hard pressure prior to juicing.</p>', '500', '20', '10', NULL, NULL, '2021-12-14 00:00:00', 'orp16', NULL, NULL, '1', NULL, NULL, '2', '1', NULL, '0', '2021-12-15 17:56:40', '2021-12-15 17:57:13', NULL ),
( '1011', 'Deshi Gajor (Local Carrot) ± 25 gm', 'deshi-gajor-local-carrot-25-gm', '100486', '<p>Fresh Carrots pre-packed for your convenience. Carrots are an excellent source of vitamin a and they help promote heart, eye, brain, skin and liver health. Best eaten raw for maximum health benefits.</p>', '200', '30', '20', NULL, NULL, '2021-12-07 00:00:00', 'orp17', NULL, NULL, '1', NULL, NULL, '2', '1', NULL, '0', '2021-12-15 17:57:41', '2021-12-15 17:58:18', NULL ),
( '1012', 'Kolmi Shak (Water Spinach)', 'kolmi-shak-water-spinach', '100487', '<p>Water Spinach is a green vegetable and that water spinach is ranked high among the world’s healthiest foods and there are plenty of reasons for it being so. Water spinach is one of the ideal option to manage weight and to lower the cholesterol levels. Water spinach consists of rich amounts of iron that is required by the red blood cells during process of hemoglobin formation. So people who are suffering with anemia should include their diet with this iron rich leafy vegetable. It also serves the iron requirement of a pregnant women. Water spinach consists of rich nutrients which are known to be as pre-requisite for the maintenance of healthy hair and scalp. Spinach juice is a single solution for the hair growth, to prevent hair fall and also to improve the texture and quality of hair.</p>', '200', '50', '40', NULL, NULL, '2021-12-08 00:00:00', 'orp18', NULL, NULL, '1', NULL, NULL, '2', '1', NULL, '0', '2021-12-15 17:58:48', '2021-12-15 17:59:20', NULL ),
( '1013', 'Ada (Imported Ginger) ± 25 gm', 'ada-imported-ginger-25-gm', '100488', '<p>It is sweet and floral on your tongue, tickles your sinuses, and warms the back of your throat. Ginger brings out the flavor in sweet and savory foods and works very well in curries, marinades and stir-fries.</p>', '300', '250', '200', NULL, NULL, '2021-12-07 00:00:00', 'orp19', NULL, NULL, '2', NULL, NULL, '2', '4', NULL, '0', '2021-12-15 18:02:01', '2021-12-15 19:06:57', NULL ),
( '1014', 'Deshi Roshun (Garlic Local) ±25 gm', 'deshi-roshun-garlic-local-25-gm', '100489', '<p>Garlic is an excellent source of minerals and vitamins that are essential for optimum health. The bulbs are one of the richest sources of potassium, iron, calcium, magnesium, manganese, zinc, and selenium. Selenium is a heart-healthy mineral, and is an important cofactor for antioxidant enzymes within the body.</p>', '400', '130', '100', NULL, NULL, '2021-12-01 00:00:00', 'orp20', NULL, NULL, '1', NULL, NULL, '2', '1', NULL, '0', '2021-12-15 18:08:27', '2021-12-15 18:09:16', NULL ),
( '1015', 'Misti Kumra Fali (Sweet Pumpkin Slice) ± 40 gm', 'misti-kumra-fali-sweet-pumpkin-slice-40-gm', '100490', '<p>Sweet Pumpkin is an extremely nutrient dense food, meaning it is chock-full of vitamins and minerals but low on calories. There are many creative ways pumpkin can be incorporated into your diet, including desserts, soups, salads, preserves and even as a substitute for butter. Sweet Pumpkin is a rich source of vitamin A. Sweet Pumpkin is one of the best-known sources of the antioxidant beta-carotene. Pumpkin puree or canned pumpkin can be used as a replacement for butter or oil in baking recipes.</p>', '39', '30', '40', NULL, NULL, '2021-12-14 00:00:00', 'orp21', NULL, NULL, '1', NULL, NULL, '2', '1', NULL, '0', '2021-12-15 18:14:15', '2021-12-22 19:17:17', NULL ),
( '1016', 'Maggi Masala Noodles 2x (Free Nestle Fruita Vital 1 ltr)', 'maggi-masala-noodles-2x-free-nestle-fruita-vital-1-ltr', '100491', '<p>Buy 2 Maggi Masala Noodles 12 pack</p><p>And Get Free Nestle Fruita Vital Mango/Apple 1 pcs 1 ltr</p><p>&nbsp;</p><p>Country Of Origin: Bangladesh</p>', '29', '250', '200', NULL, NULL, '2021-12-29 00:00:00', 'orp22', NULL, NULL, '1', NULL, NULL, '2', '1', NULL, '0', '2021-12-15 18:15:30', '2021-12-22 19:17:17', NULL ),
