( '1018', 'Ispahani Mirzapore Best Leaf Tea', 'ispahani-mirzapore-best-leaf-tea', '100493', '<p>"Ispahani Mirzapore Best Leaf" is produced by blending the BEST tea leaves of the finest tea gardens in Bangladesh. It comes to you in the most modern packing, designed to protect its excellent aroma and taste.</p>', '400', '40', '30', NULL, NULL, '2021-12-14 00:00:00', 'orp23', NULL, NULL, '1', NULL, NULL, '2', '1', NULL, '0', '2021-12-15 18:18:42', '2021-12-15 18:19:20', NULL ),
( '1019', 'Brooke Bond Taaza Black Tea', 'brooke-bond-taaza-black-tea', '100494', '<p>In order to stay on top of your packed day, all you need is a clear mind – what\'s better than a cup of new Brooke Bond Taaza to refresh &amp; clear your mind. Because only new Brooke Bond Taaza is a tea with High Quality fresh Tea Leaves, packed with the Natural Goodness of Theanine, that helps to clear your mind and enables you to manage the demands of everyday life. This tea is perfect for those Spirited Aspirers who believe that the brighter future of their family is the center of their universe. Our world-class tea tasters and experts blend the tea that results in the exceptional colour, superior taste and impeccable aroma of each “Dana” of our brand. Strong processes ensure that the quality remains consistent throughout the year. Taaza makes sure that this phenomenal journey also resonates in every end cup as absolute refreshment!</p>', '45', '200', '100', NULL, NULL, '2021-12-06 00:00:00', 'orp24', NULL, NULL, '1', NULL, NULL, '2', '1', NULL, '0', '2021-12-15 18:19:51', '2021-12-15 18:20:58', NULL ),
