( '1023', 'Mother\'s Smile Profom Milk Jar', 'mothers-smile-profom-milk-jar', '100498', '<p>Origin:Australia</p><p>Product Type - A balanced Nutrition Supplement for Pregnant and Breast Feeding Mothers. Excellence in food quality and safety - Pregnancy and lactating are the most nutritionally demanded period for a women\'s life. Body needs extra nutrinets during this time for growing baby and child bearing mother. The developing baby gets all required nutrients from the mother what she takes as food and supplements. The needs of essential nutrients are more necessary to pregnant and lactating mothers than other woman. The additional need is about 300k.cal per day during this vital period. Optimal Well - Being For You and Your Baby - During this demanding time in pregnancy and lactating period you need peace of mind and nutrition. Profom is formulated for you to be healthy and active in pregnancy &amp; lactating Period. Profom is a specialized composition of dairy based powder which is enriched with vitamins, minerals, Dietary fibre and DHA to create a nutritionally advanced product suitable for pregnant and lactating mothers. Product Benefit - 100% Autralian Made high in milk proteins Optimize Energy Levels No added flavor 100% Sugar Free Enrihed with Folic Acid, Calcium, Iron, Zinc &amp; DHA Low in sodium, high in calcium and Vitamin D Ideal Supplemented food option for pregnant and lactating women who wish to meet additional energy and nutrient needs</p>', '29', '800', '600', NULL, NULL, '2021-12-12 00:00:00', 'orp30', NULL, NULL, '1', NULL, NULL, '2', '4', NULL, '0', '2021-12-15 18:26:09', '2021-12-22 19:17:52', NULL ),
